 ('33', '248', 'en', 'Sean Harland - Tue, 13 Nov 2018 13:45', NULL, 'Sean', 'Harland', NULL, 'sean@mattersfx.com', '07584908483', NULL, NULL, NULL, 'Hi there\r\n\r\nIm after a pair of centrifugal fans for use as wind machines in the SFX industry. Im not exactly sure what my requirements are in terms of pressure and volume so am hoping you can advise. These would be used mostly for blowing hair / clothing from a distance of 3-4m with as much force as possible. But also used to throw confetti / particulates in the air as far as possible. They need to be portable too. I will probably adapt them to have wheels on, but size and weight should be kept as small as possible. I used centrifugal fans at my old company which I am trying to match. the propeller blade inside was approx 300mm diameter if that helps. and there entire unit probably around 600mm tall. the output was circular 8\" diameter, so we could attach ducting if needed. motor is 240V. Basically I need something as powerful as possible for this sort of dimensions. \r\n\r\n\r\nthankyou', '2018-11-13 13:45:20', '2018-11-13 13:45:20', 'a927c9ee-f4ff-44d7-98a4-066ca6ea5275'),
