 ('71', '286', 'en', 'Andrew Darby - Mon, 24 Jun 2019 08:49', NULL, 'Andrew', 'Darby', NULL, 'andrew.darby@dl-bsl.co.uk', '01942 842507', NULL, NULL, NULL, 'Quotation for the following at Manchester Airport: -\r\nModel - HT BIF\r\ndBA - 98.4\r\nDuty - 2.0m3/sec\r\nElec - 3 phase', '2019-06-24 07:49:14', '2019-06-24 07:49:14', '1a118862-2215-4bcc-838b-b71c1eac8c21'),
 ('72', '287', 'en', 'Esmail Najafi - Wed, 26 Jun 2019 15:07', NULL, 'Esmail', 'Najafi', NULL, 'e.najafi@samad-power.co.uk', '01908260688', NULL, NULL, NULL, 'Dear Sir/Madam,\r\n\r\nI have researched your company and believe that we can offer you External rotor motors (Permanent Magnet) and Frequency Converters for direct-driven centrifugal fan applications.\r\nWe have been developing a range of innovative products and technologies since 2010. Since its inception the company has been involved across a range of R&D activities aimed at developing customised solutions for micro turbine-CHP systems while lowering the manufacturing cost. \r\n\r\nWe believe that our technology could benefit an organisation like yours and we are looking for businesses to introduce the product to the market through their established sales channels. \r\n\r\nYours faithfully,\r\nEsmail Najafi \r\n\r\nProduct Manager\r\nTel: +44 (0) 1908 260688\r\nMob: +44 (0) 7979907078\r\nE-mail: e.najafi@samad-power.co.uk\r\nwww.samad-power.co.uk\r\nSamad Power Ltd.\r\n', '2019-06-26 14:07:44', '2019-06-26 14:07:44', 'f78ee077-28c0-4300-8bc5-c3ca85e24c49'),
 ('73', '288', 'en', 'Andrea Liguori - Fri, 28 Jun 2019 16:38', NULL, 'Andrea', 'Liguori', NULL, 'aliguori@alliance.co.uk', '01909 495460', NULL, NULL, NULL, 'Dear Victoria Fans,\r\n\r\nI am emailing from Alliance Medical Radiopharmacy in Dinnington regarding 2 ventilation units installed when the site was called IBA Molecular Imaging Limited.\r\nSite has been reopened and these units require servicing.\r\nCould you please let me know your availability please?\r\nOn one of these units there was the information below.\r\nSerial no. 06203; Job No. 82066.\r\n\r\nKind Regards,\r\n\r\nAndrea Liguori\r\n', '2019-06-28 15:38:44', '2019-06-28 15:38:44', '570756d0-c553-49e3-a4f1-fa5f7c25f238'),
 ('74', '289', 'en', 'David Stockhill - Thu, 04 Jul 2019 07:35', NULL, 'David', 'Stockhill', NULL, 'david.stockhill@tkac.co.uk', '01709880861', NULL, NULL, NULL, 'Hi, we are the HVAC maintenance providers for the Bar & Block Aldgate for Whitbread and we have one of your fans installed on the site. There is an issue with it what we cannot fathom and require a cost for a service engineer to attend site to undertake further investigations on the system. From the data plate on the fan this looks to be 10 months old would this be under some kind of manufacturers warranty? If not this is not a problem please provide a quote for the investigations. They cook from early morning to late at night so any investigations i.e turning off the fan would have to be done of an evening please can you factor this into your costings.\r\nIf there are any questions please do not hesitate to contact me,\r\n\r\nKindest Regards\r\nDavid Stockhill\r\nService Director for Turn Key Air Conditioning Ltd', '2019-07-04 06:35:49', '2019-07-04 06:35:49', 'e737292d-e064-41ad-8abe-95c73eb41e55'),
 ('75', '290', 'en', 'Tashiv Ramsander - Wed, 10 Jul 2019 17:33', NULL, 'Tashiv', 'Ramsander', NULL, 'trr21@cam.ac.uk', '07956925275', NULL, NULL, NULL, 'Dear VF,\r\n I am a researcher at the University of Cambridge and we are looking for a blower for a test. This blower will be used for suction. The specs are : medium : air temperature: 25C pressure: suction at -50mbar (-5kPa) flowrate (max): 0.5 m3/s (1800m3/h) motor: 3 phase uk supply (415V, 50Hz) Can you please advise on a blower that will (or) is close to these requirements? \r\nKind Regards, Dr. T. Ramsander', '2019-07-10 16:33:17', '2019-07-10 16:33:17', 'c9ddb8b4-24ea-407a-8a67-911e9aed1050'),
 ('76', '291', 'en', 'Stewart Cameron - Thu, 25 Jul 2019 07:53', NULL, 'Stewart', 'Cameron', NULL, 'r49elect@enscorowan.com', '01224442983', NULL, NULL, NULL, 'Hi, we have a ventilation system installed at our location with 4 x CEMP 480v electric motors model number AB70160MB4 at 22.9A and 13kw. it states on the duct work that fitted are vicroria fan motors 800LCA at the same power. Could you provide any assistance with the actual frame size of this motor, a quote for a new item please?\r\n\r\nkind regards,\r\n\r\nStewart Cameron', '2019-07-25 06:53:08', '2019-07-25 06:53:08', '293b5ad7-dc3f-4ffd-9be6-cc4ad0876546'),
 ('77', '292', 'en', 'Mick  Garraghan - Thu, 25 Jul 2019 09:43', NULL, 'Mick ', 'Garraghan', NULL, 'michael.garraghan@hgkippax.co.uk', '01484515112', NULL, NULL, NULL, '', '2019-07-25 08:43:52', '2019-07-25 08:43:52', '8e0fafe0-3272-431d-bd88-01397f754bb6'),
 ('78', '293', 'en', 'Peter Kirk - Wed, 31 Jul 2019 14:52', NULL, 'Peter', 'Kirk', NULL, 'p.kirk@peakpackaging.co.uk', '01159444555', NULL, NULL, NULL, 'Hello, I am currently in design stage for a blower to inflate an air bladder for increased liquid discharge. \r\nDo you supply a small lightweight blower fan that has a high flow rate.  The pressure would be in the region of 1 psi.\r\n\r\nRegards\r\nPete\r\nPeak Packaging', '2019-07-31 13:52:49', '2019-07-31 13:52:49', '229d5cb9-2fd4-473a-838d-b2d1ce20c76c');
