INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_fd_product_global_ShortIntroduction`, `field_fd_specialNote`, `field_fd_product_Individual_Short_Summary`, `field_fd_positioning`, `field_catFd_categoryIntroduction`, `field_fd_productRangeIntroduction`, `field_textOverMap`, `field_introTitle`, `field_introText`, `field_expandedText`, `field_secondaryTitle`, `field_secondaryText`, `field_globalMetaDescription`, `field_globalMetaTitle`, `field_globalSeoOgDescription`, `field_globalSeoOgTitle`, `field_globalSeoTwitterHandle`, `field_globalSeoTwitterDescription`, `field_globalSeoTwitterTitle`, `field_seo_metaDescription`, `field_seo_metaOgDescription`, `field_seo_metaOgTitle`, `field_seo_metaTitle`, `field_seo_metaTwitterDescription`, `field_seo_metaTwitterTitle`, `field_dataSheetOption`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '1', 'en', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2017-02-27 15:05:18', '2017-02-27 15:05:18', 'd48ca024-d652-4438-a3dc-962962d1f6c3'),
 ('2', '2', 'en', 'Welcome to Victoria Fans', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Victoriafans will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Manufacturers and Trade Suppliers of quality, reliable and robust Industrial Fans for over 30 years.', '', '', '', '', '', '0', '2017-02-27 15:05:21', '2018-06-27 08:28:16', 'dad32780-537e-4516-b84f-11244b4888f3'),
 ('4', '4', 'en', 'General Ventilation', NULL, NULL, NULL, NULL, NULL, '<p>The following axial type fans are suitable for air volumes from 500 to 100,000 m3/hr.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2017-02-27 15:10:36', '2018-09-04 12:46:46', 'bc052df8-01ea-4e6a-abd0-020f9b1eabc9'),
 ('5', '5', 'en', 'Fume Control', NULL, NULL, NULL, NULL, NULL, '<p>There are a number of factors to take into account when installing a fume control system: The type of substance in the contaminated area, flammability or combustibility, required airflow, pressure, resistance and of course the mounting position and space available. Our advisory team are always happy to chat through your particular circumstance and ensure you order the correct product.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2017-02-27 15:10:49', '2018-09-04 12:47:13', '230df4f4-69d8-4aa4-9295-4d030d7a75e9'),
 ('6', '6', 'en', 'Emergency Smoke Extraction', NULL, NULL, NULL, NULL, NULL, '<p>In the event of a fire in densely populated buildings such as Hospitals, Stores, Sports Centres and Shopping Malls, it is essential that adequate emergency smoke ventilation is provided.  This not only keeps escapes routes clear but also minimises damage to buildings and contents and assists the Fire Service in fighting fire.</p>\n<p>The type of fan can be used as part of a Roof Extract unit incorporating a Victoria fabricated steel Vertical Jet Roof Extract Cowl.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2017-02-27 15:11:01', '2017-10-03 08:47:02', '9448227d-ccd3-444f-95fe-b694d9c55e45'),
 ('7', '7', 'en', ' Roof Extract Fans', NULL, NULL, NULL, NULL, NULL, '<p>As their suggests this range of fans is used on flat or sloping roofs and is suitable for exhausting warm and contaminated air up to a maximum ambient temperatures of 60°C using an Axial or Propeller type fan upto 600°C using Axials or Bifurcated fans.</p>\n<p>Air volumes from 0.5 – 50m³/sec</p>\n<p>Both LOW PROFILE and VERTICAL JET models can be fitted with single or three phase motor in TEFC or EXD Zone 1 or 2 enclosures.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2017-02-27 15:11:11', '2018-09-04 12:49:15', 'aa12e500-e50d-4db9-9162-be5313669573'),
 ('16', '17', 'en', 'Axial Flow Fans', NULL, '<p>Our Axial Fans can be supplied as both cased and plate mounted versions. These fans are suitable for most applications including general ventilation for large, medium and small industrial spaces.  The size of space and purpose will determine which variant and size of fan is most appropriate to your specific requirement.  Our experts are on hand to assist you with choosing the correct fan.</p>', 'All Long and Short cased fans can be supplied with 304 or 316 Stainless Steel Casings', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '0', '2017-02-27 16:02:49', '2018-01-18 11:28:28', 'a04c4c22-b132-4391-83c8-3ee736a6d647'),
 ('17', '18', 'en', 'Plate Mounted Axial', NULL, '<p>This is all about the plate mounted axial fan</p>', NULL, '<p>Plate Mounted Axial fans are designed for Clean Air Supply and extraction of poor quality air. By adding a vertical jet or low profile cowl, these fans serve as effective roof extract units. See Cowel options.</p>', 'Wall or roof mounting where ducting is not required.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '[\"showDownloadOption\"]', '2017-02-27 16:03:13', '2018-09-03 11:05:09', '7b15f80a-3636-4dcb-ae81-7385b3ae81b0'),
 ('18', '19', 'en', 'Bifurcated Fans', NULL, '<p>Bifurcated fans are used to exhaust a wide variety of hot gases, paint fumes, smoke, steam and dust in suspension.</p>', 'For the foodstuffs and chemical industries these fans can be constructed from stainless steel of aluminium at competitive cost.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '0', '2017-02-27 16:07:43', '2017-11-24 09:33:00', 'bf7d1aa7-647f-4330-aeed-664b9b96ede4'),
 ('19', '20', 'en', 'Centrifugal Fans', NULL, '<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m³/hr and from 25 to 15,000 PA.  Each application requires a fan with different characteristics.</p>', 'Since forward curved and paddle blade fans have overloading power characteristics it is important that the static selection pressure is achieved.  Any reduction in the requirements could easily overload the motor.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '0', '2017-02-27 16:08:02', '2018-06-20 09:49:53', '0ff74193-578b-44d5-992a-b97b9f8bb30e'),
 ('20', '21', 'en', 'Flameproof Fans for hazardous areas, zones 1 & 2', NULL, '<p>All Axial and Centrifugal fans can be fabricated to suite hazardous areas, Zone 1 and Zone 2.  Please contact our sales team for specific information.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '0', '2017-02-27 16:08:22', '2018-01-10 09:47:14', 'd557dd43-ea08-4191-8080-54d751ec3b91'),
 ('21', '22', 'en', 'Conical Bifurcated', NULL, '', NULL, '<p>Useful for exhausting hot gases, paint fumes (excluding cellulose), steam, smoke and dust laden air. Available in diameters 150mm to 1500mm</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '[\"showDownloadOption\"]', '2017-02-27 16:09:02', '2018-09-03 11:06:46', '8b72e471-6f95-49f0-a0e6-6dfed8072bf1'),
 ('22', '23', 'en', 'Cylindrical Bifurcated', NULL, '', NULL, '<p>Useful for exhausting hot gases, paint fumes (excluding cellulose), steam, smoke and dust laden air. Available in diameters 150mm to 1500mm</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '[\"showDownloadOption\"]', '2017-02-27 16:09:23', '2018-09-03 11:06:42', '826c6e3d-51e0-49b9-bb90-49da942de0f2'),
 ('23', '24', 'en', 'Long Cased Axial', NULL, '', NULL, '<p>For Duct Mounted applications moving clean or contaminated air supply and extraction. They can be fitted with Standard or Atex rated motors with single or 3 phase supply. Fan casings can also be fabricated in 304 and 316 Stainless Steel.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '[\"showDownloadOption\"]', '2017-02-27 16:09:41', '2018-09-03 11:07:00', '00602024-205d-4eb4-bf49-cbfed71fcb7b'),
 ('24', '25', 'en', 'Short Cased Axial', NULL, '', NULL, '<p>Short Cased Axial are applied at the end of a duct or on a wall. They can be fitted with Standard or Atex rated motors with single or 3 phase supply. Fan casings can also be fabricated in 304 and 316 Stainless Steel.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '[\"showDownloadOption\"]', '2017-02-27 16:10:05', '2018-09-03 11:06:55', '0042d1bb-0e3f-4c47-807d-dfc2075f2f2c'),
 ('27', '28', 'en', 'Man Cooler Axial', NULL, '<p>This range of fans are used to provide ventilation in factories or confined spaces where a fixed installation would not provide enough flexibility. These fans are useful in welding and paint fume exhausts, grain and hay drying, brick cooling, steel billet cooling and ships hold ventilation. Flexible or canvas hose can be fitted to the inlet of the fan to give \'point\' extract from remote locations.</p>', '', '<p>As an alternative to fixed installations, this flexible range is ideal in the ventilation of factories or confined spaces such as ships\' holds.  Man Cooler Fans are also useful for cooling bricks and drying grain.  These fans can be aimed at distinct locations by fitting a flexible or canvas hose.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '[\"showDownloadOption\"]', '2017-02-27 16:10:56', '2018-09-03 11:06:50', 'f7732f24-0c45-4fcf-b29c-f16c129efb71'),
 ('29', '30', 'en', 'High Pressure Centrifugal Blowers', NULL, '', NULL, '<p>As their name suggest, these fans are applied where there is a requirement for high static pressure, for example with air knives or combustion air.</p>\n<p>Velocity range15 to 30 mts/sec, static pressures from 1000 to 15000 pa.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '', '2017-02-27 16:17:30', '2018-09-03 11:07:21', '10181127-7ab7-43ed-b718-35b1e6fb1977'),
 ('31', '32', 'en', 'Paddle Bladed Centrifugal Fans', NULL, '', NULL, '<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m³/hr and from 25 to 15,000 PA. Each application requires a fan with different characteristics.</p>\n<p>Discharge velocities 7 to 20 mts/sec, static pressures from 500 to 5000 pa.</p><p>Larger fans available on request.<br /></p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '', '2017-02-27 16:18:09', '2018-09-04 12:49:35', '9f43fb66-7646-4e86-80af-b1e371c25b0b'),
 ('32', '33', 'en', 'Forward Curved Centrifugal Fans', NULL, '', NULL, '<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m³/hr and from 25 to 15,000 PA. Each application requires a fan with different characteristics.</p><p>Discharge velocities 5 to 13 mts/sec, static pressures from 100 to 1000pa.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '', '2017-02-27 16:18:18', '2018-09-04 09:16:25', '1c718a7c-ff32-4552-bcf6-81e6fb1f4ba7'),
 ('33', '34', 'en', 'Backward Curved Centrifugal Fans', NULL, '', NULL, '<p>Non-overloading power characteristics suitable for very light dust applications (e.g. clean side of dust collector) where a good efficiency is required. Used for high pressure ventilation systems or where the system resistance could fluctuate. Normal discharge velocities 16 - 30 mts/sec.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '[\"showDownloadOption\"]', '2017-02-27 16:18:46', '2018-09-03 11:09:45', '75c07ca5-ea49-49d7-aef6-0e17f3479c04'),
