 ('41', '57', 'en', 'Product Range', NULL, NULL, NULL, NULL, NULL, NULL, '<p>Curabitur convallis, arcu a posuere viverra, justo erat consequat mauris, vel dapibus ex purus rhoncus erat. Etiam egestas purus nibh, eu tincidunt nisl elementum in. Suspendisse potenti. Phasellus molestie viverra quam, ut suscipit massa eleifend id. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Maecenas volutpat sodales pellentesque. Donec ullamcorper urna mauris, ut semper mi sagittis vel. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2017-03-01 13:02:16', '2017-03-01 13:37:06', '141e493a-3ea9-4ca4-9f82-b0c74179fd7f'),
 ('42', '58', 'en', 'Hero1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2017-03-02 16:59:04', '2017-11-24 16:12:18', 'fc00a6f6-9e7d-45a9-a135-0dae4f92051e'),
 ('46', '62', 'en', 'Company Background', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Victoria Fans are proud suppliers to over 1000 organisations across 30 Countries', 'More about us', '<p>Since 1984, Victoria Fans Ltd have produced approximately 40,000 fans of all types for projects in both the UK and abroad. We are well respected in the trade and regularly product fans for other fan suppliers.</p>', '<p>Since 1984, Victoria Fans Ltd have produced approximately 40,000 fans of all types for projects in both the UK and abroad. We are well respected in the trade and regularly product fans for other fan suppliers.</p>\n<p>In the UK Victoria fans are sold directly to the ‘trade’ through a network of professional Fans &amp; Heating &amp; Ventilation distributors carefully selected to know both our products and the local area in which the enquirer trades.</p><p>In other parts of the world there is a Victoria Fans agent with considerable expertise and long association with strategic partners in Europe, the Middle East &amp; Far East.</p>\n<p>Victoria Fans are happy to make dimensional and performance modification to their range of products and can fabricated exact copies of obsolete equipment. We also welcome the opportunity to discuss new or different fan applications with original equipment manufacturers, Consultants or H &amp; V Engineers.</p>', 'STANDARDS AND CERTIFICATION', '<p>We produce fans of high quality and can provide Certificates of Conformity and Test Certificates when requested. Fan performance to BS848 and AMCA 210 and ATEX for Explosion proof fans</p>\n<p>CE Certificates are supplied as appropriate and O &amp; M instructions are available for all the type of fans we supply.</p><p>We are members of The Federation of Environmental Trade Associations Ltd (FETA) and the Fan Manufacturers Association (FMA).<br /></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '2017-03-09 14:05:31', '2017-03-09 14:14:34', 'cc4a45cc-85f4-4aea-a941-3c7bc8a48696'),
