 ('59', '119', 'en', 'Silencers', NULL, '<p>In both commercial and industrial applications the use of duct mounted silencers to reduce noise emission from fans is become more commonplace as increasing legislation calls for better and more comfortable working environments.</p>\n<p>At Victoria Industrial Fans we have a special acoustic service whereby engineers and consultants can call upon our expertise in selecting the correct method of acoustic treatment to give guaranteed noise levels in hospitals, offices, factories, etc.  Simply call our office for more details.</p>\n<p>Quite the most commonly used silencers are what is known as CYLINDRICAL (STT) and POD (STP) type silencers.  The tabulation shows the pressure losses*</p>\n<p>The length of the silencer is a function of its diameter i.e. 1 x diameter long or 2 x diameter long.  Obviously the longer the attenuator the greater the pressure drop and the greater the acoustic performance.<br /></p>\n<p>POD type silencers give better attenuation that CYLINDRICAL type silencers.</p>', '*Through POD type silencers.  The losses through CYLINDRICAL silencers are considerably less.', '<p>In both commercial and industrial applications the use of duct mounted silencers to reduce noise emission from fans is become more commonplace as increasing legislation calls for better and more comfortable working environments.</p>\n<p>At Victoria Industrial Fans we have a special acoustic service whereby engineers and consultants can call upon our expertise in selecting the correct method of acoustic treatment to give guaranteed noise levels in hospitals, offices, factories, etc.  Simply call our office for more details.</p>\n<p>Quite the most commonly used silencers are what is known as CYLINDRICAL (STT) and POD (STP) type silencers.  The tabulation shows the pressure losses*</p>\n<p>*Through POD type silencers.  The losses through CYLINDRICAL silencers are considerably less.</p>\n<p>The length of the silencer is a function of its diameter i.e. 1 x diameter long or 2 x diameter long.  Obviously the longer the attenuator the greater the pressure drop and the greater the acoustic performance.</p>\n<p>POD type silencers give better attenuation that CYLINDRICAL type silencers.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '[\"showDownloadOption\"]', '2017-07-25 09:52:07', '2018-09-03 11:06:18', 'b6afd944-3244-41ad-9b1c-cf0b36bca745'),
