 ('88', '62', '6', '1', 'en', '1', NULL, '{\"typeId\":\"7\",\"authorId\":null,\"title\":\"Company Background\",\"slug\":\"company-background\",\"postDate\":1489068331,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}', '2017-03-09 14:05:31', '2017-03-09 14:05:31', '842f3054-4502-4451-ae73-17d85b83c57a'),
 ('89', '62', '6', '1', 'en', '2', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Company Background\",\"slug\":\"company-background\",\"postDate\":1489068331,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"32\":\"\",\"29\":\"<p>Since 1984, Victoria Fans Ltd have produced approximately 40,000 fans of all types for projects in both the UK and abroad. We are well respected in the trade and regularly product fans for other fan suppliers.<\\/p>\\r\\n<p>In the UK Victoria fans are sold directly to the \\u2018trade\\u2019 through a network of professional Fans & Heating & Ventilation distributors carefully selected to know both our products and the local area in which the enquirer trades.<\\/p><p>In other parts of the world there is a Victoria Fans agent with considerable expertise and long association with strategic partners in Europe, the Middle East & Far East.<\\/p>\\r\\n<p>Victoria Fans are happy to make dimensional and performance modification to their range of products and can fabricated exact copies of obsolete equipment. We also welcome the opportunity to discuss new or different fan applications with original equipment manufacturers, Consultants or H & V Engineers.<\\/p>\",\"28\":\"<p>Since 1984, Victoria Fans Ltd have produced approximately 40,000 fans of all types for projects in both the UK and abroad. We are well respected in the trade and regularly product fans for other fan suppliers.<\\/p>\",\"27\":\"More about us\",\"31\":\"<p>We produce fans of high quality and can provide Certificates of Conformity and Test Certificates when requested. Fan performance to BS848 and AMCA 210 and ATEX for Explosion proof fans<\\/p>\\r\\n<p>CE Certificates are supplied as appropriate and O & M instructions are available for all the type of fans we supply.<\\/p><p>We are members of The Federation of Environmental Trade Associations Ltd (FETA) and the Fan Manufacturers Association (FMA).<br><\\/p>\",\"30\":\"STANDARDS AND CERTIFICATION\",\"26\":\"Victoria Fans are proud suppliers to over 1000 organisations across 30 Countries\"}}', '2017-03-09 14:14:34', '2017-03-09 14:14:34', 'c687ff6e-3804-42a0-afdf-a8d22e5e8f30'),
 ('90', '17', '3', '1', 'en', '8', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial Flow Fans\",\"slug\":\"axial-flow-fans\",\"postDate\":1488211320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":\"<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam at lectus ipsum. Nam vehicula felis a mi commodo, id lacinia nisi ultricies. Nunc ut libero sit amet diam scelerisque gravida.<\\/p>\",\"4\":{\"36\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Arrangement\",\"fd_st_text\":\"<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\\r\\n  <\\/p>\"}},\"37\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Staging Of Axial Flow Fans\",\"fd_st_text\":\"<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\\r\\n  <\\/p>\"}},\"38\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Long Cased Type\",\"fd_st_text\":\"<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.&nbsp; Essentially for duct mounting where flanges are bolted back and front.\\r\\n  <\\/p>\"}},\"41\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Short Cased Type\",\"fd_st_text\":\"<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\\r\\n  <\\/p>\"}},\"42\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>In most instances foot mounted TEFC IEC 600034-1.&nbsp; Electric motors are fitted with metric dimensions.&nbsp;&nbsp; The motors are selected to cover the \\u2018peak\\u2019 power absorbed for fan blade pitch angle and speed.&nbsp; Most standard motors have Class \\u2018F\\u2019 insulation and are suitable for operating at temperatures of up to 50\\u00b0C (122\\u00b0F). Higher temperatures available if required.\\r\\n  <\\/p>\\r\\n<p>The standard voltages are 220, 230\\/380, 380, 240\\/215 and 460.&nbsp; Motors can be wound for any voltage and frequency and also for dual voltage.&nbsp; The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed\\/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\\r\\n  <\\/p>\"}},\"43\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Standard Impellers 250-1250mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.&nbsp; Five different blade angles are available and each blade is individually replaceable in the event of breakage.&nbsp; Aluminium blades are also available in selected angles.\\r\\n  <\\/p>\"}},\"44\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Special Impellers 250-2000mm Dia\",\"fd_st_text\":\"<p>Suspendisse tellus purus, semper vitae leo in, congue euismod lorem. Vivamus ut metus mollis, lobortis augue vel, pharetra ipsum. Vivamus id vulputate urna. Vestibulum ultricies maximus purus tempus convallis. Praesent justo est, aliquam sed pretium non, bibendum ut massa. Lorem ipsum dolor sit amet, consectetur adipiscing elit.<\\/p>\"}},\"new1\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fractional Solidity Impellers\",\"fd_st_text\":\"<p>All sizes of impellers can supplied with varying number of blades to suit the application.&nbsp; This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.<\\/p>\"}}},\"25\":[\"59\"],\"7\":\"All Long and Short cased fans can be supplied with 304 or 316 Stainless Steel Casings\"}}', '2017-03-23 15:46:37', '2017-03-23 15:46:37', 'e4158a39-7d69-478d-8abd-d90b1b9a949c'),
