 ('126', '19', '3', '1', 'en', '7', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Bifurcated Fans\",\"slug\":\"bifurcated-fans\",\"postDate\":1488211620,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Bifurcated fans are used to exhaust a wide variety of hot gases, paint fumes, smoke, steam and dust in suspension.<\\/p>\",\"4\":{\"67\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Uses\",\"fd_st_text\":\"<p>For exhausting hot gasses, paint fumes (excluding, cellulose), steam, smoke and dust laden air, available in diameters 250-1250mm.<\\/p>\"}},\"68\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fan Type NT\",\"fd_st_text\":\"<p>Normal Temperature \\u2013 upto 80\\u00b0C (176\\u00b0F).&nbsp;&nbsp; Constructed in mild steel with a polypropylene impeller and Class F insulation motor.&nbsp;&nbsp; Special corrosion- resistant finishes available. &nbsp;Standard finish - Galvanised.<\\/p>\"}},\"69\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fan Type HT\",\"fd_st_text\":\"<p>High Temperature&nbsp; - upto 200\\u00b0C (392\\u00b0F).&nbsp; Constructed in mild steel with an aluminium impeller and Class F insulation motor.&nbsp; Special corrosion- resistant finishes available. Standard finish&nbsp; - galvanised.<\\/p>\"}},\"70\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>Standard three or single phase motors can be fitted along with ATEX ZONE 1 or 2 and company specification units when required.<\\/p>\"}},\"71\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Plastic Fans\",\"fd_st_text\":\"<p>This range of fans can also be constructed from rigid PVC sheet reinforced with fibreglass and suitable for a wide fans of uses in the chemical industry and in the extraction of acid fumes from industrial processes.&nbsp; Dimensions and performance data as for normal Bifurcated fans.\\r\\n  <\\/p>\\r\\n<p>For exhausting hot gasses, chemical vapours, steam and moisture laden air, available in diameters 250-1000mm.&nbsp; Max temp 60\\u00b0C<\\/p>\"}},\"72\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Stainless Steel Fan Type 304\",\"fd_st_text\":\"<p>Ideal for use in the catering industry for air temperature upto 80\\u00b0C (176\\u00b0F).&nbsp; For exhausting warm air and steam.&nbsp; Constructed throughout in stainless steel with a polypropylene impeller and Class \\u2018F\\u2019 standard motor with a stainless steel extended shaft.<\\/p>\"}},\"73\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Stainless Steel Fan Type 316\",\"fd_st_text\":\"<p>Uses mainly in the chemical and allied trades.&nbsp; Suitable for most acid vapours upto 80\\u00b0C (176\\u00b0F).&nbsp; Constructed throughout in stainless steel with a polypropylene impeller and Class F standard motor with a stainless steel extended shaft.<\\/p>\"}},\"74\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<ul><li>Mounting feet<\\/li><li>flexible connections<\\/li><li>AV Mountings<\\/li><li>Mating Flanges<\\/li><li>Inlet Cones<\\/li><li>Guards<\\/li><li>Back-draught shutters<\\/li><li>Special Paint finishes<\\/li><\\/ul>\"}},\"75\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li><strong>Standard Fans:<\\/strong> Galvanised<\\/li><li><strong>Optional Finishes:<\\/strong> Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"60\"],\"7\":\"For the foodstuffs and chemical industries these fans can be constructed from stainless steel of aluminium at competitive cost.\"}}', '2017-07-25 09:40:23', '2017-07-25 09:40:23', '99b666e5-66d5-48be-af88-fb242ba10c6b'),
