e fan to give \'point\' extract from remote locations.<\\/p>\",\"4\":{\"139\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Construction\",\"fd_st_text\":\"<p>The standard construction comprises mild steel fan body and swivel base with polypropylene or aluminium impeller & galvanised finish. &nbsp;An external terminal box is fitted to the outside of the casing for ease of connection onsite. &nbsp;The fans are supplied with inlet and outlet guards.<\\/p>\"}},\"140\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>Up to size 50cm, the fans can be fitted with single or three phase electric motors, thereafter they are normally fitted with three phase motors only.<\\/p>\\r\\n<p>For the Petro-Chemical and other hazardous industries, the fans can be fitted with EExd Zone 1 or Zone 2 Motors.<\\/p>\"}},\"141\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extras - If required\",\"fd_st_text\":\"<p>2 Speed Motors, Pre-wired starters, Epoxy Coating, Fixed or free casters and special voltages.<\\/p>\"}}},\"25\":\"\",\"7\":\"\"}}', '2017-07-26 10:26:24', '2017-07-26 10:26:24', 'daeac653-de05-49d5-a616-2acf2824767d'),
 ('173', '119', '3', '1', 'en', '16', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Silencers\",\"slug\":\"silencers\",\"postDate\":1500976320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"108\",\"fields\":{\"35\":{\"135\":{\"type\":\"ancilliaryItemText\",\"enabled\":\"1\",\"fields\":{\"itemText\":\"<p>sssIn both commercial and industrial applications the use of duct mounted silencers to reduce noise emission from fans is become more commonplace as increasing legislation calls for better and more comfortable working environments.<\\/p>\\r\\n<p>At Victoria Industrial Fans we have a special acoustic service whereby engineers and consultants can call upon our expertise in selecting the correct method of acoustic treatment to give guaranteed noise levels in hospitals, offices, factories, etc.&nbsp; Simply call our office for more details.<\\/p>\\r\\n<p>Quite the most commonly used silencers are what is known as CYLINDRICAL (STT) and POD (STP) type silencers.&nbsp; The tabulation shows the pressure losses*<\\/p>\\r\\n<p>The length of the silencer is a function of its diameter i.e. 1 x diameter long or 2 x diameter long.&nbsp; Obviously the longer the attenuator the greater the pressure drop and the greater the acoustic performance.<br><\\/p>\\r\\n<p>POD type silencers give better attenuation that CYLINDRICAL type silencers.<\\/p>\"}},\"137\":{\"type\":\"itemTechnicalDrawing\",\"enabled\":\"1\",\"fields\":{\"itemDrawing\":[\"125\"]}},\"136\":{\"type\":\"itemDataTable\",\"enabled\":\"1\",\"fields\":{\"dataTable\":\"{\\\"columns\\\":{\\\"col0\\\":{\\\"heading\\\":\\\"Diameter\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col1\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col2\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col3\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col4\\\":{\\\"heading\\\":\\\"B\\\",\\\"width\\\":\\\"\\\",\\\