ol2\":\"1100\",\"col3\":\"1100\",\"col4\":\"465\",\"col5\":\"50\",\"col6\":\"14\"},\"row6\":{\"col0\":\"900\",\"col1\":\"132\",\"col2\":\"1100\",\"col3\":\"1100\",\"col4\":\"540\",\"col5\":\"50\",\"col6\":\"14\"},\"row7\":{\"col0\":\"1000\",\"col1\":\"100\",\"col2\":\"1250\",\"col3\":\"1250\",\"col4\":\"460\",\"col5\":\"50\",\"col6\":\"14\"},\"row8\":{\"col0\":\"1000\",\"col1\":\"112\",\"col2\":\"1250\",\"col3\":\"1250\",\"col4\":\"460\",\"col5\":\"50\",\"col6\":\"14\"},\"row9\":{\"col0\":\"1000\",\"col1\":\"132\",\"col2\":\"1250\",\"col3\":\"1250\",\"col4\":\"465\",\"col5\":\"50\",\"col6\":\"14\"}}}}},\"18\":[\"154\"],\"19\":[\"55\",\"56\"],\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"12\":\"Wall or roof mounting where ducting is not required.\",\"11\":\"<p>Plate Mounted Axial fans are designed for Clean Air Supply and extraction of poor quality air. By adding a vertical jet or low profile cowl, these fans serve as effective roof extract units.<\\/p>\",\"16\":{\"48\":{\"type\":\"3\",\"fields\":{\"fd_st_noteText\":\"1. This type of fan can be fitted beneath in LOW PROFILE or VERTICAL JET ROOF COWL as supplied by Victoria Fans.\\r\\n2. The fans may only be operated when installed as intended and when safety is ensured.\"}}}}}', '2017-11-23 17:39:59', '2017-11-23 17:39:59', '068478d5-9967-400f-9866-061f07c95533'),
