":\"200\",\"col1\":\"200\",\"col2\":\"264\",\"col3\":\"610\",\"col4\":\"400\",\"col5\":\"8\",\"col6\":\"10\",\"col7\":\"242\"},\"row3\":{\"col0\":\"250\",\"col1\":\"250\",\"col2\":\"314\",\"col3\":\"610\",\"col4\":\"450\",\"col5\":\"8\",\"col6\":\"10\",\"col7\":\"295\"},\"row4\":{\"col0\":\"300\",\"col1\":\"300\",\"col2\":\"364\",\"col3\":\"610\",\"col4\":\"60\",\"col5\":\"8\",\"col6\":\"0\",\"col7\":\"344\"},\"row5\":{\"col0\":\"315\",\"col1\":\"315\",\"col2\":\"379\",\"col3\":\"610\",\"col4\":\"560\",\"col5\":\"8\",\"col6\":\"10\",\"col7\":\"355\"},\"row6\":{\"col0\":\"355\",\"col1\":\"355\",\"col2\":\"434\",\"col3\":\"650\",\"col4\":\"600\",\"col5\":\"8\",\"col6\":\"12\",\"col7\":\"395\"},\"row7\":{\"col0\":\"400\",\"col1\":\"400\",\"col2\":\"484\",\"col3\":\"680\",\"col4\":\"660\",\"col5\":\"8\",\"col6\":\"12\",\"col7\":\"450\"},\"row8\":{\"col0\":\"450\",\"col1\":\"450\",\"col2\":\"534\",\"col3\":\"790\",\"col4\":\"735\",\"col5\":\"8\",\"col6\":\"12\",\"col7\":\"500\"},\"row9\":{\"col0\":\"500\",\"col1\":\"500\",\"col2\":\"584\",\"col3\":\"790\",\"col4\":\"735\",\"col5\":\"12\",\"col6\":\"12\",\"col7\":\"560\"},\"row10\":{\"col0\":\"560\",\"col1\":\"560\",\"col2\":\"644\",\"col3\":\"800\",\"col4\":\"760\",\"col5\":\"12\",\"col6\":\"12\",\"col7\":\"620\"},\"row11\":{\"col0\":\"600\",\"col1\":\"600\",\"col2\":\"684\",\"col3\":\"800\",\"col4\":\"760\",\"col5\":\"12\",\"col6\":\"12\",\"col7\":\"644\"},\"row12\":{\"col0\":\"630\",\"col1\":\"630\",\"col2\":\"714\",\"col3\":\"800\",\"col4\":\"760\",\"col5\":\"12\",\"col6\":\"12\",\"col7\":\"690\"},\"row13\":{\"col0\":\"710\",\"col1\":\"710\",\"col2\":\"794\",\"col3\":\"800\",\"col4\":\"900\",\"col5\":\"16\",\"col6\":\"12\",\"col7\":\"770\"},\"row14\":{\"col0\":\"800\",\"col1\":\"800\",\"col2\":\"908\",\"col3\":\"1000\",\"col4\":\"1000\",\"col5\":\"16\",\"col6\":\"12\",\"col7\":\"860\"},\"row15\":{\"col0\":\"900\",\"col1\":\"900\",\"col2\":\"1033\",\"col3\":\"1250\",\"col4\":\"1200\",\"col5\":\"16\",\"col6\":\"15\",\"col7\":\"970\"},\"row16\":{\"col0\":\"1000\",\"col1\":\"1000\",\"col2\":\"1133\",\"col3\":\"1300\",\"col4\":\"1350\",\"col5\":\"16\",\"col6\":\"15\",\"col7\":\"1070\"},\"row17\":{\"col0\":\"1120\",\"col1\":\"1120\",\"col2\":\"1253\",\"col3\":\"1400\",\"col4\":\"1450\",\"col5\":\"20\",\"col6\":\"18\",\"col7\":\"1190\"},\"row18\":{\"col0\":\"1250\",\"col1\":\"1250\",\"col2\":\"1406\",\"col3\":\"1600\",\"col4\":\"1600\",\"col5\":\"20\",\"col6\":\"18\",\"col7\":\"1320\"}}}}},\"18\":[\"156\"],\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"12\":\"\",\"11\":\"<p>Useful for exhausting hot gases, paint fumes (excluding cellulose), steam, smoke and dust laden air. &nbsp;Available in diameters 150mm to 1500mm<\\/p>\",\"16\":{\"146\":{\"type\":\"3\",\"fields\":{\"fd_st_noteText\":\"Flange drillings to BS EN ISO 13351 2009(E)\"}}}}}', '2017-11-23 17:41:25', '2017-11-23 17:41:25', '805d4077-283b-4b00-b31d-3bc09bd49691'),
 ('189', '17', '3', '1', 'en', '14', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial Flow Fans\",\"slug\":\"axial-flow-fans\",\"postDate\":1488211320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Our Axial Fans can be supplied as both cased and plate mounted versions. These fans are suitable for most applications including general ventilation for large, medium and small industrial spaces. &nbsp;The size of space and purpose will determine which variant and size of fan is most appropriate to your specific requirement. &nbsp;Our experts are on hand to assist you with choosing the correct fan.<\\/p>\",\"4\":{\"36\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Arrangement\",\"fd_st_text\":\"<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\\r\\n  <\\/p>\"}},\"37\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Staging Of Axial Flow Fans\",\"fd_st_text\":\"<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\\r\\n  <\\/p>\"}},\"38\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Long Cased Type\",\"fd_st_text\":\"<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.&nbsp; Essentially for duct mounting where flanges are bolted back and front.\\r\\n  <\\/p>\"}},\"41\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Short Cased Type\",\"fd_st_text\":\"<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\\r\\n  <\\/p>\"}},\"42\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>In most instances foot mounted TEFC IEC 600034-1.&nbsp; Electric motors are fitted with metric dimensions.&nbsp;&nbsp; The motors are selected to cover the \\u2018peak\\u2019 power absorbed for fan blade pitch angle and speed.&nbsp; Most standard motors have Class \\u2018F\\u2019 insulation and are suitable for operating at temperatures of up to 50\\u00b0C (122\\u00b0F). Higher temperatures available if required.\\r\\n  <\\/p>\\r\\n<p>The standard voltages are 220, 230\\/380, 380, 240\\/215 and 460.&nbsp; Motors can be wound for any voltage and frequency and also for dual voltage.&nbsp; The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed\\/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\\r\\n  <\\/p>\"}},\"43\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Standard Impellers 250-1250mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.&nbsp; Five different blade angles are available and each blade is individually replaceable in the event of breakage.&nbsp; Aluminium blades are also available in selected angles.\\r\\n  <\\/p>\"}},\"44\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Special Impellers 250-2000mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil variable pitch aluminium blades fixed into a die-cast aluminium hub.\\r\\n  <\\/p>\"}},\"63\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fractional Solidity Impellers\",\"fd_st_text\":\"<p>All sizes of impellers can supplied with varying number of blades to suit the application.&nbsp; This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.<\\/p>\"}},\"64\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Example of Coding\",\"fd_st_text\":\"<p>A typical example of coding is 630\\/9\\/35 indicating :\\r\\n  <\\/p>\\r\\n<ul><li>630 diameter in mm<\\/li><li>9 number of blades<\\/li><li>35 blade angle in degrees<\\/li><\\/ul>\"}},\"65\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<p>Mounting feet, flexible connections, AV Mountings, Mating Flanges, Inlet Cones, Guards, Back-draught shutters, Special Paint.&nbsp; Finishes: External Terminal Box.<\\/p>\"}},\"66\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li>Standard Fans: Galvanised<\\/li><li>Optional Finishes: Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"150\"],\"7\":\"All Long and Short cased fans can be supplied with 304 or 316 Stainless Steel Casings\"}}', '2017-11-24 09:32:39', '2017-11-24 09:32:39', '8814f0a8-1507-4533-bb19-6aad5d969422'),
 ('190', '17', '3', '1', 'en', '15', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial Flow Fans\",\"slug\":\"axial-flow-fans\",\"postDate\":1488211320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Our Axial Fans can be supplied as both cased and plate mounted versions. These fans are suitable for most applications including general ventilation for large, medium and small industrial spaces. &nbsp;The size of space and purpose will determine which variant and size of fan is most appropriate to your specific requirement. &nbsp;Our experts are on hand to assist you with choosing the correct fan.<\\/p>\",\"4\":{\"36\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Arrangement\",\"fd_st_text\":\"<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\\r\\n  <\\/p>\"}},\"37\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Staging Of Axial Flow Fans\",\"fd_st_text\":\"<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\\r\\n  <\\/p>\"}},\"38\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Long Cased Type\",\"fd_st_text\":\"<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.&nbsp; Essentially for duct mounting where flanges are bolted back and front.\\r\\n  <\\/p>\"}},\"41\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Short Cased Type\",\"fd_st_text\":\"<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\\r\\n  <\\/p>\"}},\"42\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>In most instances foot mounted TEFC IEC 600034-1.&nbsp; Electric motors are fitted with metric dimensions.&nbsp;&nbsp; The motors are selected to cover the \\u2018peak\\u2019 power absorbed for fan blade pitch angle and speed.&nbsp; Most standard motors have Class \\u2018F\\u2019 insulation and are suitable for operating at temperatures of up to 50\\u00b0C (122\\u00b0F). Higher temperatures available if required.\\r\\n  <\\/p>\\r\\n<p>The standard voltages are 220, 230\\/380, 380, 240\\/215 and 460.&nbsp; Motors can be wound for any voltage and frequency and also for dual voltage.&nbsp; The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed\\/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\\r\\n  <\\/p>\"}},\"43\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Standard Impellers 250-1250mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.&nbsp; Five different blade angles are available and each blade is individually replaceable in the event of breakage.&nbsp; Aluminium blades are also available in selected angles.\\r\\n  <\\/p>\"}},\"44\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Special Impellers 250-2000mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil variable pitch aluminium blades fixed into a die-cast aluminium hub.\\r\\n  <\\/p>\"}},\"63\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fractional Solidity Impellers\",\"fd_st_text\":\"<p>All sizes of impellers can supplied with varying number of blades to suit the application.&nbsp; This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.<\\/p>\"}},\"64\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Example of Coding\",\"fd_st_text\":\"<p>A typical example of coding is 630\\/9\\/35 indicating :\\r\\n  <\\/p>\\r\\n<ul><li>630 diameter in mm<\\/li><li>9 number of blades<\\/li><li>35 blade angle in degrees<\\/li><\\/ul>\"}},\"65\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<p>Mounting feet, flexible connections, AV Mountings, Mating Flanges, Inlet Cones, Guards, Back-draught shutters, Special Paint.&nbsp; Finishes: External Terminal Box.<\\/p>\"}},\"66\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li>Standard Fans: Galvanised<\\/li><li>Optional Finishes: Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"150\"],\"7\":\"All Long and Short cased fans can be supplied with 304 or 316 Stainless Steel Casings\"}}', '2017-11-24 09:32:42', '2017-11-24 09:32:42', 'a138756c-ba03-4829-b258-1c506b3d695c'),
 ('191', '19', '3', '1', 'en', '11', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Bifurcated Fans\",\"slug\":\"bifurcated-fans\",\"postDate\":1488211620,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Bifurcated fans are used to exhaust a wide variety of hot gases, paint fumes, smoke, steam and dust in suspension.<\\/p>\",\"4\":{\"67\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Uses\",\"fd_st_text\":\"<p>For exhausting hot gasses, paint fumes (excluding, cellulose), steam, smoke and dust laden air, available in diameters 250-1250mm.<\\/p>\"}},\"68\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fan Type NT\",\"fd_st_text\":\"<p>Normal Temperature \\u2013 upto 80\\u00b0C (176\\u00b0F).&nbsp;&nbsp; Constructed in mild steel with a polypropylene impeller and Class F insulation motor.&nbsp;&nbsp; Special corrosion- resistant finishes available. Standard finish - Galvanised.<\\/p>\"}},\"69\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fan Type HT\",\"fd_st_text\":\"<p>High Temperature&nbsp; - upto 200\\u00b0C (392\\u00b0F).&nbsp; Constructed in mild steel with an aluminium impeller and Class F insulation motor.&nbsp; Special corrosion- resistant finishes available. Standard finish&nbsp; - galvanised.<\\/p>\"}},\"70\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>Standard three or single phase motors can be fitted along with ATEX ZONE 1 or 2 and company specification units when required.<\\/p>\"}},\"71\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Plastic Fans\",\"fd_st_text\":\"<p>This range of fans can also be constructed from rigid PVC sheet reinforced with fibreglass and suitable for a wide fans of uses in the chemical industry and in the extraction of acid fumes from industrial processes.&nbsp; Dimensions and performance data as for normal Bifurcated fans.\\r\\n  <\\/p>\\r\\n<p>For exhausting hot gasses, chemical vapours, steam and moisture laden air, available in diameters 250-1000mm.&nbsp; Max temp 60\\u00b0C<\\/p>\"}},\"72\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Stainless Steel Fan Type 304\",\"fd_st_text\":\"<p>Ideal for use in the catering industry for air temperature upto 80\\u00b0C (176\\u00b0F).&nbsp; For exhausting warm air and steam.&nbsp; Constructed throughout in stainless steel with a polypropylene impeller and Class \\u2018F\\u2019 standard motor with a stainless steel extended shaft.<\\/p>\"}},\"73\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Stainless Steel Fan Type 316\",\"fd_st_text\":\"<p>Uses mainly in the chemical and allied trades.&nbsp; Suitable for most acid vapours upto 80\\u00b0C (176\\u00b0F).&nbsp; Constructed throughout in stainless steel with a polypropylene impeller and Class F standard motor with a stainless steel extended shaft.<\\/p>\"}},\"74\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<ul><li>Mounting feet<\\/li><li>flexible connections<\\/li><li>AV Mountings<\\/li><li>Mating Flanges<\\/li><li>Inlet Cones<\\/li><li>Guards<\\/li><li>Back-draught shutters<\\/li><li>Special Paint finishes<\\/li><\\/ul>\"}},\"75\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li><strong>Standard Fans:<\\/strong> Galvanised<\\/li><li><strong>Optional Finishes:<\\/strong> Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"157\"],\"7\":\"For the foodstuffs and chemical industries these fans can be constructed from stainless steel of aluminium at competitive cost.\"}}', '2017-11-24 09:33:00', '2017-11-24 09:33:00', '3466d82a-3d4c-4461-9b57-a419d6ae1447'),
 ('192', '20', '3', '1', 'en', '10', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Centrifugal Fans\",\"slug\":\"centrifugal-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Praesent non elit nec sem interdum suscipit quis imperdiet felis. Praesent nulla ligula, consectetur sit amet tortor commodo, tristique viverra ex. Pellentesque laoreet erat sit amet sagittis tempor.<\\/p>\",\"4\":{\"76\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Applications\",\"fd_st_text\":\"<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:<\\/p>\\r\\n<ol><li><ol><li>High Temperature<\\/li><li>Low Noise Levels<\\/li><li>Dust & Fume Extract<\\/li><li>High Static Watergauge<\\/li><\\/ol><\\/li><\\/ol>\"}},\"77\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Types of Centrifugal Fans\",\"fd_st_text\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.&nbsp; By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.<\\/p>\"}},\"88\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Paddle Blade Fans\",\"fd_st_text\":\"<p>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.&nbsp; Since the blade design prevents \\u2018build up\\u2019 of waste materials, discharge velocities vary dependent upon what is being conveyed in the air stream.&nbsp; Normally in the region of 7-20 mtrs\\/sec.<\\/p>\"}},\"89\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Multivane or Forward Curved Fans\",\"fd_st_text\":\"<p>Used for general ventilation purposes \\u2013 not good for dust etc.&nbsp; Limited pressure characteristics.&nbsp; Normal discharge velocities 5-13 mts\\/sec<\\/p>\"}},\"90\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Backward Curved or Backward Sloping Fans\",\"fd_st_text\":\"<p>Non overloading power characteristics suitable for very light dust applications (eg clean side of dust collector) where a good efficiency is required.&nbsp; Used for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal velocities 9-16 mts\\/sec<\\/p>\"}},\"91\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Aerofoil Fans\",\"fd_st_text\":\"<p>The most efficient of all centrifugals fans, ideally suited to general ventilation projects where there is no possibility of dust contamination.&nbsp; Recommend for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal discharge velocities 7-15 mts\\/sec.<\\/p>\"}},\"92\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"High Pressure Blowers\",\"fd_st_text\":\"<p>As their name suggests, these fans are applied where the requirement is for high velocities, eg Air Curtains, refuse conveying etc&nbsp; Normal discharge velocities 15-30 mts\\/sec.<\\/p>\"}}},\"25\":[\"153\"],\"7\":\"Since forward curved and paddle blade fans have overloading power characteristics it is important that the static selection pressure is achieved.  Any reduction in the requirements could easily overload the motor.\"}}', '2017-11-24 09:33:29', '2017-11-24 09:33:29', '721387c6-3937-4161-80c7-87a1e2bf7b79'),
 ('193', '17', '3', '1', 'en', '16', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial Flow Fans\",\"slug\":\"axial-flow-fans\",\"postDate\":1488211320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Our Axial Fans can be supplied as both cased and plate mounted versions. These fans are suitable for most applications including general ventilation for large, medium and small industrial spaces. &nbsp;The size of space and purpose will determine which variant and size of fan is most appropriate to your specific requirement. &nbsp;Our experts are on hand to assist you with choosing the correct fan.<\\/p>\",\"4\":{\"36\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Arrangement\",\"fd_st_text\":\"<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\\r\\n  <\\/p>\"}},\"37\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Staging Of Axial Flow Fans\",\"fd_st_text\":\"<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\\r\\n  <\\/p>\"}},\"38\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Long Cased Type\",\"fd_st_text\":\"<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.&nbsp; Essentially for duct mounting where flanges are bolted back and front.\\r\\n  <\\/p>\"}},\"41\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Short Cased Type\",\"fd_st_text\":\"<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\\r\\n  <\\/p>\"}},\"42\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>In most instances foot mounted TEFC IEC 600034-1.&nbsp; Electric motors are fitted with metric dimensions.&nbsp;&nbsp; The motors are selected to cover the \\u2018peak\\u2019 power absorbed for fan blade pitch angle and speed.&nbsp; Most standard motors have Class \\u2018F\\u2019 insulation and are suitable for operating at temperatures of up to 50\\u00b0C (122\\u00b0F). Higher temperatures available if required.\\r\\n  <\\/p>\\r\\n<p>The standard voltages are 220, 230\\/380, 380, 240\\/215 and 460.&nbsp; Motors can be wound for any voltage and frequency and also for dual voltage.&nbsp; The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed\\/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\\r\\n  <\\/p>\"}},\"43\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Standard Impellers 250-1250mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.&nbsp; Five different blade angles are available and each blade is individually replaceable in the event of breakage.&nbsp; Aluminium blades are also available in selected angles.\\r\\n  <\\/p>\"}},\"44\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Special Impellers 250-2000mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil variable pitch aluminium blades fixed into a die-cast aluminium hub.\\r\\n  <\\/p>\"}},\"63\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fractional Solidity Impellers\",\"fd_st_text\":\"<p>All sizes of impellers can supplied with varying number of blades to suit the application.&nbsp; This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.<\\/p>\"}},\"64\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Example of Coding\",\"fd_st_text\":\"<p>A typical example of coding is 630\\/9\\/35 indicating :\\r\\n  <\\/p>\\r\\n<ul><li>630 diameter in mm<\\/li><li>9 number of blades<\\/li><li>35 blade angle in degrees<\\/li><\\/ul>\"}},\"65\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<p>Mounting feet, flexible connections, AV Mountings, Mating Flanges, Inlet Cones, Guards, Back-draught shutters, Special Paint.&nbsp; Finishes: External Terminal Box.<\\/p>\"}},\"66\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li>Standard Fans: Galvanised<\\/li><li>Optional Finishes: Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"150\"],\"7\":\"All Long and Short cased fans can be supplied with 304 or 316 Stainless Steel Casings\"}}', '2017-11-24 09:36:55', '2017-11-24 09:36:55', 'a148c79e-0839-4e4a-9101-27f783ab1c43'),
 ('194', '108', '3', '1', 'en', '3', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial & Bifurcated Ancillaries\",\"slug\":\"axial-bifurcated-ancillaries\",\"postDate\":1500974580,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>The following ancillaries can be provided as optional extras for Axial and Bifurcated Fans<\\/p>\",\"4\":\"\",\"25\":[\"154\"],\"7\":\"\"}}', '2017-11-24 09:37:17', '2017-11-24 09:37:17', '31bdad95-04f6-4e87-b964-d21474db4995'),
 ('195', '21', '3', '1', 'en', '8', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Flameproof Fans for hazardous areas, zones 1 & 2\",\"slug\":\"flameproof-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Morbi quis pulvinar nisi. Proin et magna enim. Donec quis mi vitae diam fringilla placerat et hendrerit massa. Vestibulum sit amet urna posuere diam lacinia egestas.<\\/p>\",\"4\":\"\",\"25\":[\"155\"],\"7\":\"\"}}', '2017-11-24 09:38:03', '2017-11-24 09:38:03', 'e0b5ac42-0c79-49eb-a369-ca48253689a9'),
 ('196', '119', '3', '1', 'en', '19', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Silencers\",\"slug\":\"silencers\",\"postDate\":1500976320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"108\",\"fields\":{\"35\":{\"135\":{\"type\":\"ancilliaryItemText\",\"enabled\":\"1\",\"fields\":{\"itemText\":\"<p>In both commercial and industrial applications the use of duct mounted silencers to reduce noise emission from fans is become more commonplace as increasing legislation calls for better and more comfortable working environments.<\\/p>\\r\\n<p>At Victoria Industrial Fans we have a special acoustic service whereby engineers and consultants can call upon our expertise in selecting the correct method of acoustic treatment to give guaranteed noise levels in hospitals, offices, factories, etc.&nbsp; Simply call our office for more details.<\\/p>\\r\\n<p>Quite the most commonly used silencers are what is known as CYLINDRICAL (STT) and POD (STP) type silencers.&nbsp; The tabulation shows the pressure losses*<\\/p>\\r\\n<p>The length of the silencer is a function of its diameter i.e. 1 x diameter long or 2 x diameter long.&nbsp; Obviously the longer the attenuator the greater the pressure drop and the greater the acoustic performance.<br><\\/p>\\r\\n<p>POD type silencers give better attenuation that CYLINDRICAL type silencers.<\\/p>\"}},\"137\":{\"type\":\"itemTechnicalDrawing\",\"enabled\":\"1\",\"fields\":{\"itemDrawing\":[\"125\"]}},\"136\":{\"type\":\"itemDataTable\",\"enabled\":\"1\",\"fields\":{\"dataTable\":\"{\\\"columns\\\":{\\\"col0\\\":{\\\"heading\\\":\\\"Diameter\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col1\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col2\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col3\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col4\\\":{\\\"heading\\\":\\\"B\\\",\\\"width\\\":\\\"\\\",\\\"al