 ('218', '119', '3', '1', 'en', '21', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Silencers\",\"slug\":\"silencers\",\"postDate\":1500976320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"108\",\"fields\":{\"35\":{\"135\":{\"type\":\"ancilliaryItemText\",\"enabled\":\"1\",\"fields\":{\"itemText\":\"<p>IIn both commercial and industrial applications the use of duct mounted silencers to reduce noise emission from fans is become more commonplace as increasing legislation calls for better and more comfortable working environments.<\\/p>\\r\\n<p>At Victoria Industrial Fans we have a special acoustic service whereby engineers and consultants can call upon our expertise in selecting the correct method of acoustic treatment to give guaranteed noise levels in hospitals, offices, factories, etc.&nbsp; Simply call our office for more details.<\\/p>\\r\\n<p>Quite the most commonly used silencers are what is known as CYLINDRICAL (STT) and POD (STP) type silencers.&nbsp; The tabulation shows the pressure losses*<\\/p>\\r\\n<p>The length of the silencer is a function of its diameter i.e. 1 x diameter long or 2 x diameter long.&nbsp; Obviously the longer the attenuator the greater the pressure drop and the greater the acoustic performance.<br><\\/p>\\r\\n<p>POD type silencers give better attenuation that CYLINDRICAL type silencers.<\\/p>\"}},\"137\":{\"type\":\"itemTechnicalDrawing\",\"enabled\":\"1\",\"fields\":{\"itemDrawing\":\"\"}},\"136\":{\"type\":\"itemDataTable\",\"enabled\":\"1\",\"fields\":{\"dataTable\":\"{\\\"columns\\\":{\\\"col0\\\":{\\\"heading\\\":\\\"Diameter\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col1\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col2\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col3\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col4\\\":{\\\"heading\\\":\\\"B\\\",\\\"width\\\":\\\"\\\",\\\"align\