0\",\"col5\":\"604\",\"col6\":\"12\",\"col7\":\"8\"},\"row6\":{\"col0\":\"630\",\"col1\":\"630\",\"col2\":\"945\",\"col3\":\"1260\",\"col4\":\"790\",\"col5\":\"674\",\"col6\":\"12\",\"col7\":\"8\"},\"row7\":{\"col0\":\"710\",\"col1\":\"710\",\"col2\":\"1065\",\"col3\":\"1420\",\"col4\":\"870\",\"col5\":\"754\",\"col6\":\"12\",\"col7\":\"8\"},\"row8\":{\"col0\":\"800\",\"col1\":\"800\",\"col2\":\"1200\",\"col3\":\"1600\",\"col4\":\"1010\",\"col5\":\"858\",\"col6\":\"12\",\"col7\":\"12\"},\"row9\":{\"col0\":\"900\",\"col1\":\"900\",\"col2\":\"1350\",\"col3\":\"1800\",\"col4\":\"1110\",\"col5\":\"980\",\"col6\":\"16\",\"col7\":\"12\"},\"row10\":{\"col0\":\"1000\",\"col1\":\"1000\",\"col2\":\"1500\",\"col3\":\"2000\",\"col4\":\"1210\",\"col5\":\"1080\",\"col6\":\"16\",\"col7\":\"12\"}}}},\"142\":{\"type\":\"additionalInformation\",\"enabled\":\"1\",\"fields\":{\"addAdditionalInfo\":{\"143\":{\"type\":\"5\",\"fields\":{\"header\":\"Finish\",\"text\":\"Standard Silencers - Galvanised Steel.\"}},\"144\":{\"type\":\"5\",\"fields\":{\"header\":\"Optional Extras\",\"text\":\"Melinex Lining for steam\\/high humidity\\/hospital and food industries, Epoxy coating, Stainless Steel construction.\"}}}}}}}}', '2017-11-24 11:18:49', '2017-11-24 11:18:49', '7696644f-d5ed-4d09-8531-5fa45738878c'),
 ('220', '20', '3', '1', 'en', '11', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Centrifugal Fans\",\"slug\":\"centrifugal-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":[\"177\"],\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Praesent non elit nec sem interdum suscipit quis imperdiet felis. Praesent nulla ligula, consectetur sit amet tortor commodo, tristique viverra ex. Pellentesque laoreet erat sit amet sagittis tempor.<\\/p>\",\"4\":{\"76\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Applications\",\"fd_st_text\":\"<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:<\\/p>\\r\\n<ol><li><ol><li>High Temperature<\\/li><li>Low Noise Levels<\\/li><li>Dust & Fume Extract<\\/li><li>High Static Watergauge<\\/li><\\/ol><\\/li><\\/ol>\"}},\"77\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Types of Centrifugal Fans\",\"fd_st_text\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.&nbsp; By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.<\\/p>\"}},\"88\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Paddle Blade Fans\",\"fd_st_text\":\"<p>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.&nbsp; Since the blade design prevents \\u2018build up\\u2019 of waste materials, discharge velocities vary dependent upon what is being conveyed in the air stream.&nbsp; Normally in the region of 7-20 mtrs\\/sec.<\\/p>\"}},\"89\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Multivane or Forward Curved Fans\",\"fd_st_text\":\"<p>Used for general ventilation purposes \\u2013 not good for dust etc.&nbsp; Limited pressure characteristics.&nbsp; Normal discharge velocities 5-13 mts\\/sec<\\/p>\"}},\"90\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Backward Curved or Backward Sloping Fans\",\"fd_st_text\":\"<p>Non overloading power characteristics suitable for very light dust applications (eg clean side of dust collector) where a good efficiency is required.&nbsp; Used for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal velocities 9-16 mts\\/sec<\\/p>\"}},\"91\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Aerofoil Fans\",\"fd_st_text\":\"<p>The most efficient of all centrifugals fans, ideally suited to general ventilation projects where there is no possibility of dust contamination.&nbsp; Recommend for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal discharge velocities 7-15 mts\\/sec.<\\/p>\"}},\"92\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"High Pressure Blowers\",\"fd_st_text\":\"<p>As their name suggests, these fans are applied where the requirement is for high velocities, eg Air Curtains, refuse conveying etc&nbsp; Normal discharge velocities 15-30 mts\\/sec.<\\/p>\"}}},\"25\":[\"153\"],\"7\":\"Since forward curved and paddle blade fans have overloading power characteristics it is important that the static selection pressure is achieved.  Any reduction in the requirements could easily overload the motor.\"}}', '2017-11-24 12:00:44', '2017-11-24 12:00:44', '149f5e7a-3a8f-4e88-9d2e-6f7ebe2f4370'),
 ('221', '20', '3', '1', 'en', '12', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Centrifugal Fans\",\"slug\":\"centrifugal-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":[\"177\",\"127\"],\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Praesent non elit nec sem interdum suscipit quis imperdiet felis. Praesent nulla ligula, consectetur sit amet tortor commodo, tristique viverra ex. Pellentesque laoreet erat sit amet sagittis tempor.<\\/p>\",\"4\":{\"76\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Applications\",\"fd_st_text\":\"<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:<\\/p>\\r\\n<ol><li><ol><li>High Temperature<\\/li><li>Low Noise Levels<\\/li><li>Dust & Fume Extract<\\/li><li>High Static Watergauge<\\/li><\\/ol><\\/li><\\/ol>\"}},\"77\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Types of Centrifugal Fans\",\"fd_st_text\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.&nbsp; By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.<\\/p>\"}},\"88\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Paddle Blade Fans\",\"fd_st_text\":\"<p>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.&nbsp; Since the blade design prevents \\u2018build up\\u2019 of waste materials, discharge velocities vary dependent upon what is being conveyed in the air stream.&nbsp; Normally in the region of 7-20 mtrs\\/sec.<\\/p>\"}},\"89\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Multivane or Forward Curved Fans\",\"fd_st_text\":\"<p>Used for general ventilation purposes \\u2013 not good for dust etc.&nbsp; Limited pressure characteristics.&nbsp; Normal discharge velocities 5-13 mts\\/sec<\\/p>\"}},\"90\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Backward Curved or Backward Sloping Fans\",\"fd_st_text\":\"<p>Non overloading power characteristics suitable for very light dust applications (eg clean side of dust collector) where a good efficiency is required.&nbsp; Used for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal velocities 9-16 mts\\/sec<\\/p>\"}},\"91\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Aerofoil Fans\",\"fd_st_text\":\"<p>The most efficient of all centrifugals fans, ideally suited to general ventilation projects where there is no possibility of dust contamination.&nbsp; Recommend for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal discharge velocities 7-15 mts\\/sec.<\\/p>\"}},\"92\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"High Pressure Blowers\",\"fd_st_text\":\"<p>As their name suggests, these fans are applied where the requirement is for high velocities, eg Air Curtains, refuse conveying etc&nbsp; Normal discharge velocities 15-30 mts\\/sec.<\\/p>\"}}},\"25\":[\"153\"],\"7\":\"Since forward curved and paddle blade fans have overloading power characteristics it is important that the static selection pressure is achieved.  Any reduction in the requirements could easily overload the motor.\"}}', '2017-11-24 12:04:39', '2017-11-24 12:04:39', '95c36862-d968-4996-8553-24d002ea5949'),
 ('222', '20', '3', '1', 'en', '13', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Centrifugal Fans\",\"slug\":\"centrifugal-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"21\":\"\",\"19\":[\"177\"],\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Praesent non elit nec sem interdum suscipit quis imperdiet felis. Praesent nulla ligula, consectetur sit amet tortor commodo, tristique viverra ex. Pellentesque laoreet erat sit amet sagittis tempor.<\\/p>\",\"4\":{\"76\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Applications\",\"fd_st_text\":\"<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:<\\/p>\\r\\n<ol><li><ol><li>High Temperature<\\/li><li>Low Noise Levels<\\/li><li>Dust & Fume Extract<\\/li><li>High Static Watergauge<\\/li><\\/ol><\\/li><\\/ol>\"}},\"77\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Types of Centrifugal Fans\",\"fd_st_text\":\"<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m\\u00b3\\/hr and from 25 to 15,000 PA.&nbsp; Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.&nbsp; By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.<\\/p>\"}},\"88\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Paddle Blade Fans\",\"fd_st_text\":\"<p>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.&nbsp; Since the blade design prevents \\u2018build up\\u2019 of waste materials, discharge velocities vary dependent upon what is being conveyed in the air stream.&nbsp; Normally in the region of 7-20 mtrs\\/sec.<\\/p>\"}},\"89\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Multivane or Forward Curved Fans\",\"fd_st_text\":\"<p>Used for general ventilation purposes \\u2013 not good for dust etc.&nbsp; Limited pressure characteristics.&nbsp; Normal discharge velocities 5-13 mts\\/sec<\\/p>\"}},\"90\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Backward Curved or Backward Sloping Fans\",\"fd_st_text\":\"<p>Non overloading power characteristics suitable for very light dust applications (eg clean side of dust collector) where a good efficiency is required.&nbsp; Used for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal velocities 9-16 mts\\/sec<\\/p>\"}},\"91\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Aerofoil Fans\",\"fd_st_text\":\"<p>The most efficient of all centrifugals fans, ideally suited to general ventilation projects where there is no possibility of dust contamination.&nbsp; Recommend for high pressure ventilation systems or where the system resistance could fluctuate.&nbsp; Normal discharge velocities 7-15 mts\\/sec.<\\/p>\"}},\"92\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"High Pressure Blowers\",\"fd_st_text\":\"<p>As their name suggests, these fans are applied where the requirement is for high velocities, eg Air Curtains, refuse conveying etc&nbsp; Normal discharge velocities 15-30 mts\\/sec.<\\/p>\"}}},\"25\":[\"153\"],\"7\":\"Since forward curved and paddle blade fans have overloading power characteristics it is important that the static selection pressure is achieved.  Any reduction in the requirements could easily overload the motor.\"}}', '2017-11-24 12:07:16', '2017-11-24 12:07:16', '42654c87-5cef-4590-b1a9-ca9ef6cdbeb5'),
