 ('233', '184', '3', '1', 'en', '3', '', '{\"typeId\":\"8\",\"authorId\":\"1\",\"title\":\"Low profile roof units compatible with Plate Mounted Axials\",\"slug\":\"low-profile-roof-units-compatible-with-plate-mounted-axials\",\"postDate\":1511531940,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"17\",\"fields\":{\"35\":{\"187\":{\"type\":\"itemTechnicalDrawing\",\"enabled\":\"1\",\"fields\":{\"itemDrawing\":[\"185\"]}},\"189\":{\"type\":\"itemDataTable\",\"enabled\":\"1\",\"fields\":{\"dataTable\":\"{\\\"columns\\\":{\\\"col0\\\":{\\\"heading\\\":\\\"Unit Ref\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col1\\\":{\\\"heading\\\":\\\"A\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col2\\\":{\\\"heading\\\":\\\"B\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col3\\\":{\\\"heading\\\":\\\"C\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col4\\\":{\\\"heading\\\":\\\"D\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"},\\\"col5\\\":{\\\"heading\\\":\\\"E\\\",\\\"width\\\":\\\"\\\",\\\"align\\\":\\\"left\\\"}},\\\"rows\\\":{\\\"row0\\\":{\\\"col0\\\":\\\"RA250\\\",\\\"col1\\\":\\\"490\\\",\\\"col2\\\":\\\"310\\\",\\\"col3\\\":\\\"440\\\",\\\"col4\\\":\\\"90\\\",\\\"col5\\\":\\\"330\\\"},\\\"row1\\\":{\\\"col0\\\":\\\"RA315\\\",\\\"col1\\\":\\\"555\\\",\\\"col2\\\":\\\"340\\\",\\\"col3\\\":\\\"490\\\",\\\"col4\\\":\\\"90\\\",\\\"col5\\\":\\\"330\\\"},\\\"row2\\\":{\\\"col0\\\":\\\"RA400\\/450\\\",\\\"col1\\\":\\\"765\\\",\\\"col2\\\":\\\"460\\\",\\\"col3\\\":\\\"740\\\",\\\"col4\\\":\\\"90\\\",\\\"col5\\\":\\\"330\\\"},\\\"row3\\\":{\\\"col0\\\":\\\"RA500\\/560\\\",\\\"col1\\\":\\\"995\\\",\\\"col2\\\":\\\"550\\\",\\\"col3\\\":\\\"890\\\",\\\"col4\\\":\\\"120\\\",\\\"col5\\\":\\\"380\\\"},\\\"row4\\\":{\\\"col0\\\":\\\"RA630\\/710\\\",\\\"col1\\\":\\\"1115\\\",\\\"col2\\\":\\\"650\\\",\\\"col3\\\":\\\"990\\\",\\\"col4\\\":\\\"120\\\",\\\"col5\\\":\\\"375\\/410\\/445\\\"},\\\"row5\\\":{\\\"col0\\\":\\\"RA800\\\",\\\