0\\\",\\\"col1\\\":\\\"1410\\\",\\\"col2\\\":\\\"750\\\",\\\"col3\\\":\\\"1090\\\",\\\"col4\\\":\\\"100\\\",\\\"col5\\\":\\\"460\\/465\\/540\\\"},\\\"row6\\\":{\\\"col0\\\":\\\"RA900\\/1000\\\",\\\"col1\\\":\\\"1650\\\",\\\"col2\\\":\\\"750\\\",\\\"col3\\\":\\\"1340\\\",\\\"col4\\\":\\\"80\\\",\\\"col5\\\":\\\"460\\/465\\\"}}}\",\"columns\":{\"col0\":{\"heading\":\"Unit Ref\",\"width\":\"\",\"align\":\"left\"},\"col1\":{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},\"col2\":{\"heading\":\"B\",\"width\":\"\",\"align\":\"left\"},\"col3\":{\"heading\":\"C\",\"width\":\"\",\"align\":\"left\"},\"col4\":{\"heading\":\"D\",\"width\":\"\",\"align\":\"left\"},\"col5\":{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"}},\"rows\":{\"row0\":{\"col0\":\"RA250\",\"col1\":\"490\",\"col2\":\"310\",\"col3\":\"440\",\"col4\":\"90\",\"col5\":\"330\"},\"row1\":{\"col0\":\"RA315\",\"col1\":\"555\",\"col2\":\"340\",\"col3\":\"490\",\"col4\":\"90\",\"col5\":\"330\"},\"row2\":{\"col0\":\"RA400\\/450\",\"col1\":\"765\",\"col2\":\"460\",\"col3\":\"740\",\"col4\":\"90\",\"col5\":\"330\"},\"row3\":{\"col0\":\"RA500\\/560\",\"col1\":\"995\",\"col2\":\"550\",\"col3\":\"890\",\"col4\":\"120\",\"col5\":\"380\"},\"row4\":{\"col0\":\"RA630\\/710\",\"col1\":\"1115\",\"col2\":\"650\",\"col3\":\"990\",\"col4\":\"120\",\"col5\":\"375\\/410\\/445\"},\"row5\":{\"col0\":\"RA800\",\"col1\":\"1410\",\"col2\":\"750\",\"col3\":\"1090\",\"col4\":\"100\",\"col5\":\"460\\/465\\/540\"},\"row6\":{\"col0\":\"RA900\\/1000\",\"col1\":\"1650\",\"col2\":\"750\",\"col3\":\"1340\",\"col4\":\"80\",\"col5\":\"460\\/465\"}}}}}}}', '2017-11-24 16:15:38', '2017-11-24 16:15:38', '3f406b09-3073-4eae-a9a0-c7137ac820b0'),
 ('237', '17', '3', '1', 'en', '17', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial Flow Fans\",\"slug\":\"axial-flow-fans\",\"postDate\":1488211320,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"57\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>Our Axial Fans can be supplied as both cased and plate mounted versions. These fans are suitable for most applications including general ventilation for large, medium and small industrial spaces. &nbsp;The size of space and purpose will determine which variant and size of fan is most appropriate to your specific requirement. &nbsp;Our experts are on hand to assist you with choosing the correct fan.<\\/p>\",\"4\":{\"36\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Arrangement\",\"fd_st_text\":\"<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\\r\\n  <\\/p>\"}},\"37\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Staging Of Axial Flow Fans\",\"fd_st_text\":\"<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\\r\\n  <\\/p>\"}},\"38\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Long Cased Type\",\"fd_st_text\":\"<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.&nbsp; Essentially for duct mounting where flanges are bolted back and front.\\r\\n  <\\/p>\"}},\"41\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Short Cased Type\",\"fd_st_text\":\"<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\\r\\n  <\\/p>\"}},\"42\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>In most instances foot mounted TEFC IEC 600034-1.&nbsp; Electric motors are fitted with metric dimensions.&nbsp;&nbsp; The motors are selected to cover the \\u2018peak\\u2019 power absorbed for fan blade pitch angle and speed.&nbsp; Most standard motors have Class \\u2018F\\u2019 insulation and are suitable for operating at temperatures of up to 50\\u00b0C (122\\u00b0F). Higher temperatures available if required.\\r\\n  <\\/p>\\r\\n<p>The standard voltages are 220, 230\\/380, 380, 240\\/215 and 460.&nbsp; Motors can be wound for any voltage and frequency and also for dual voltage.&nbsp; The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed\\/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\\r\\n  <\\/p>\"}},\"43\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Standard Impellers 250-1250mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.&nbsp; Five different blade angles are available and each blade is individually replaceable in the event of breakage.&nbsp; Aluminium blades are also available in selected angles.\\r\\n  <\\/p>\"}},\"44\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Special Impellers 250-2000mm Dia\",\"fd_st_text\":\"<p>Impellers have aerofoil variable pitch aluminium blades fixed into a die-cast aluminium hub.\\r\\n  <\\/p>\"}},\"63\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Fractional Solidity Impellers\",\"fd_st_text\":\"<p>All sizes of impellers can supplied with varying number of blades to suit the application.&nbsp; This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.<\\/p>\"}},\"64\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Example of Coding\",\"fd_st_text\":\"<p>A typical example of coding is 630\\/9\\/35 indicating :\\r\\n  <\\/p>\\r\\n<ul><li>630 diameter in mm<\\/li><li>9 number of blades<\\/li><li>35 blade angle in degrees<\\/li><\\/ul>\"}},\"65\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extra Features Available\",\"fd_st_text\":\"<p>Mounting feet, flexible connections, AV Mountings, Mating Flanges, Inlet Cones, Guards, Back-draught shutters, Special Paint.&nbsp; Finishes: External Terminal Box.<\\/p>\"}},\"66\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Finish\",\"fd_st_text\":\"<ul><li>Standard Fans: Galvanised<\\/li><li>Optional Finishes: Epoxy Resin, Metal Spraying<\\/li><\\/ul>\"}}},\"25\":[\"154\"]}}', '2018-01-10 09:32:14', '2018-01-10 09:32:14', 'fa6708ce-54da-46ca-96d8-2355f1425585'),
 ('238', '108', '3', '1', 'en', '4', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Axial & Bifurcated Ancillaries\",\"slug\":\"axial-bifurcated-ancillaries\",\"postDate\":1500974580,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"57\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>The following ancillaries can be provided as optional extras for Axial and Bifurcated Fans<\\/p>\",\"4\":\"\",\"25\":\"\"}}', '2018-01-10 09:32:59', '2018-01-10 09:32:59', 'b7022eed-1d26-45a7-aab6-af6272c19463'),
 ('239', '21', '3', '1', 'en', '9', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Flameproof Fans for hazardous areas, zones 1 & 2\",\"slug\":\"flameproof-fans\",\"postDate\":1488211680,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"57\":\"\",\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>All Axial and Centrifugal fans can be fabricated to suite hazardous areas, Zone 1 and Zone 2.&nbsp; Please contact our sales team for specific information.<\\/p>\",\"4\":\"\",\"25\":[\"155\"]}}', '2018-01-10 09:47:14', '2018-01-10 09:47:14', '194ed9c3-320d-40a5-a2e0-9ec9bd3a3655'),
