 ('310', '28', '3', '1', 'en', '11', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Man Cooler Axial\",\"slug\":\"man-cooler-axial-flow-fans\",\"postDate\":1488211800,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"17\",\"fields\":{\"57\":\"\",\"73\":[\"showDownloadOption\"],\"48\":\"\",\"49\":\"\",\"50\":\"\",\"51\":\"\",\"52\":\"\",\"53\":\"\",\"3\":\"<p>This range of fans are used to provide ventilation in factories or confined spaces where a fixed installation would not provide enough flexibility. &nbsp;These fans are useful in welding and paint fume exhausts, grain and hay drying, brick cooling, steel billet cooling and ships hold ventilation. Flexible or canvas hose can be fitted to the inlet of the fan to give \'point\' extract from remote locations.<\\/p>\",\"4\":{\"139\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Construction\",\"fd_st_text\":\"<p>The standard construction comprises mild steel fan body and swivel base with polypropylene or aluminium impeller & galvanised finish. &nbsp;An external terminal box is fitted to the outside of the casing for ease of connection onsite. &nbsp;The fans are supplied with inlet and outlet guards.<\\/p>\"}},\"140\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Motors\",\"fd_st_text\":\"<p>Up to size 50cm, the fans can be fitted with single or three phase electric motors, thereafter they are normally fitted with three phase motors only.<\\/p>\\r\\n<p>For the Petro-Chemical and other hazardous industries, the fans can be fitted with EExd Zone 1 or Zone 2 Motors.<\\/p>\"}},\"141\":{\"type\":\"1\",\"fields\":{\"fd_St_Header\":\"Extras - If required\",\"fd_st_text\":\"<p>2 Speed Motors, Pre-wired starters, Epoxy Coating, Fixed or free casters and special voltages.<\\/p>\"}}},\"25\":\"\"}}', '2018-09-03 11:06:50', '2018-09-03 11:06:50', 'c5aeea63-d62d-4de4-b8cb-2d5a4ac650bd'),
