 ('20', '166', 'en', NULL, '{\"columns\":[{\"heading\":\"Size\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"B\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"C\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"D\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"F\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"G\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"250\",\"200\",\"255\",\"232\",\"26\",\"60\",\"30\",\"10\"],[\"315\",\"240\",\"310\",\"275\",\"25.5\",\"60\",\"30\",\"10\"],[\"355\",\"250\",\"310\",\"350\",\"40\",\"60\",\"30\",\"10\"],[\"400\",\"300\",\"360\",\"400\",\"40\",\"60\",\"30\",\"10\"],[\"450\",\"295\",\"410\",\"450\",\"40\",\"60\",\"30\",\"10\"],[\"500\",\"360\",\"410\",\"500\",\"40\",\"75\",\"35\",\"10\"],[\"560\",\"350\",\"410\",\"560\",\"60\",\"75\",\"35\",\"10\"],[\"630\",\"390\",\"410\",\"630\",\"60\",\"75\",\"35\",\"10\"],[\"710\",\"435\",\"480\",\"710\",\"50\",\"75\",\"35\",\"14\"],[\"800\",\"480\",\"525\",\"800\",\"50\",\"75\",\"35\",\"14\"],[\"900\",\"535\",\"625\",\"900\",\"50\",\"75\",\"35\",\"14\"],[\"1000\",\"580\",\"700\",\"1000\",\"50\",\"75\",\"35\",\"14\"],[\"1120\",\"670\",\"760\",\"1100\",\"50\",\"75\",\"35\",\"14\"],[\"1250\",\"775\",\"830\",\"1250\",\"50\",\"80\",\"35\",\"14\"]]}', '2017-11-24 10:30:34', '2018-10-22 10:05:42', '959be4b2-c648-4fc2-9c3c-28bbaea481aa'),
 ('21', '167', 'en', NULL, NULL, '2017-11-24 11:01:52', '2018-09-03 11:06:33', 'a6f321fe-d476-4469-baa1-1300626b7780'),
 ('22', '168', 'en', NULL, '{\"columns\":[{\"heading\":\"Size\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"B\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"C\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"D\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"F\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"G\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"Load\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"Type 1\",\"37\",\"26\",\"27\",\"67\",\"54\",\"7\",\"8\",\"4 to 54 Kg\"],[\"Type 2\",\"57\",\"46\",\"35\",\"98\",\"76\",\"8\",\"12\",\"23 to 376 Kg\"]]}', '2017-11-24 11:01:52', '2018-09-03 11:06:33', '8ef22dfd-d54e-48ef-b80d-1762b1c31e8a'),
 ('23', '169', 'en', '<p>Normally sold as a ‘pair’, the mounting feet sit beneath an axial or a bifurcated fan for horizontal applications. The feet are fabricated from mild steel with a hot dipped galvanized finish. </p>\n<p>Mounting feet can be supplied in 304 or 316 stainless steel.</p>', NULL, '2017-11-24 11:02:49', '2018-10-22 10:05:42', '57a1119e-6a8f-4d5e-a6d1-bdd0d5cb77e2'),
 ('24', '170', 'en', '<p>Rubber-in-Compression type supplied as standard. Spring type mountings can be supplied for heavy/slow running fans.</p>', NULL, '2017-11-24 11:03:08', '2018-09-03 11:06:33', '128d3479-5e56-428d-927c-8077037b218c'),
 ('25', '171', 'en', '<p>Fabricated in Mild Steel with hot dipped Galvanised finish, also supplied in 304 and 316 Stainless Steel.</p>', NULL, '2017-11-24 11:03:32', '2018-09-03 11:06:28', 'ac1b9278-e33f-4b0d-9b6d-0af7ef6eb01e'),
 ('26', '172', 'en', '<p>Normally fitted to the Inlet and Outlet of Axial Fans so as to allow the Fan to be removed from the ductwork system, connections can be supplied for Acoustic and High Temperature applications.</p>', NULL, '2017-11-24 11:03:44', '2018-09-03 11:06:23', '764c6e22-896d-489d-bb0f-e801ce6af0bf'),
 ('27', '173', 'en', NULL, NULL, '2017-11-24 11:09:34', '2018-09-03 11:06:28', '6546182b-682b-4fb5-b7b2-39c3e4f7d25a'),
 ('28', '174', 'en', NULL, '{\"columns\":[{\"heading\":\"Size\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"F\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"G\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"250\",\"250\",\"344\",\"40\"],[\"315\",\"315\",\"395\",\"40\"],[\"355\",\"355\",\"434\",\"40\"],[\"400\",\"400\",\"484\",\"40\"],[\"450\",\"450\",\"534\",\"40\"],[\"500\",\"500\",\"584\",\"40\"],[\"560\",\"560\",\"644\",\"40\"],[\"630\",\"630\",\"714\",\"40\"],[\"710\",\"710\",\"794\",\"40\"],[\"750\",\"750\",\"858\",\"40\"],[\"800\",\"800\",\"908\",\"50\"],[\"900\",\"900\",\"1033\",\"63\"],[\"1000\",\"1000\",\"1133\",\"63\"],[\"1100\",\"1100\",\"1233\",\"63\"],[\"1250\",\"1250\",\"1378\",\"63\"]]}', '2017-11-24 11:09:34', '2018-09-03 11:06:28', 'a43d2b37-0660-4333-8a39-895465740962'),
