 ('33', '189', 'en', NULL, '{\"columns\":[{\"heading\":\"Unit Ref\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"A\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"B\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"C\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"D\",\"width\":\"\",\"align\":\"left\"},{\"heading\":\"E\",\"width\":\"\",\"align\":\"left\"}],\"rows\":[[\"RA250\",\"490\",\"310\",\"440\",\"90\",\"330\"],[\"RA315\",\"555\",\"340\",\"490\",\"90\",\"330\"],[\"RA400\\/450\",\"765\",\"460\",\"740\",\"90\",\"330\"],[\"RA500\\/560\",\"995\",\"550\",\"890\",\"120\",\"380\"],[\"RA630\\/710\",\"1115\",\"650\",\"990\",\"120\",\"375\\/410\\/445\"],[\"RA800\",\"1410\",\"750\",\"1090\",\"100\",\"460\\/465\\/540\"],[\"RA900\\/1000\",\"1650\",\"750\",\"1340\",\"80\",\"460\\/465\"]]}', '2017-11-24 14:09:14', '2018-09-03 11:06:12', '36082103-7c71-439e-baff-538db8234366'),
 ('34', '213', 'en', '<p>An Ancillary \'Pack\' would comprise 2 mounting feet, 2 mating flanges, 2 flexible connections and 4 rubber-in compression anti vibration mountings.</p>\n<p>In addition, Victoria Fans can also supply, inlet cones, backdraught shutters and inlet/outlet guards.</p>', NULL, '2018-04-25 11:52:16', '2018-09-03 11:06:08', '3d74cbdf-73a3-4848-9fb4-8d2f0cfb7b1d');
