 ('20', 'field', '4', 'en', ' applications engineers must consider the use of centrifugal fans instead of axial fans for some of the following reasons high temperaturelow noise levelsdust fume extracthigh static watergauge types of centrifugal fans there are different types of centrifugal fans covering air volumes from 85 to 100 000m hr and from 25 to 15 000 pa each application requires a fan with different characteristics whether it be the blade design the width of the casing or even the method of drive by way of a guide as to which is the best fan for certain projects we list below information that might assist the potential user paddle blade fans this type of fan is used for the conveying of dust wood and paper refuse cotton fly etc since the blade design prevents build up of waste materials discharge velocities vary dependent upon what is being conveyed in the air stream normally in the region of 7 20 mtrs sec multivane or forward curved fans used for general ventilation purposes not good for dust etc limited pressure characteristics normal discharge velocities 5 13 mts sec backward curved or backward sloping fans non overloading power characteristics suitable for very light dust applications eg clean side of dust collector where a good efficiency is required used for high pressure ventilation systems or where the system resistance could fluctuate normal velocities 9 16 mts sec aerofoil fans the most efficient of all centrifugals fans ideally suited to general ventilation projects where there is no possibility of dust contamination recommend for high pressure ventilation systems or where the system resistance could fluctuate normal discharge velocities 7 15 mts sec high pressure blowers as their name suggests these fans are applied where the requirement is for high velocities eg air curtains refuse conveying etc normal discharge velocities 15 30 mts sec '),
