 ('62', 'slug', '0', 'en', ' company background '),
 ('62', 'title', '0', 'en', ' company background '),
 ('62', 'field', '26', 'en', ' victoria fans are proud suppliers to over 1000 organisations across 30 countries '),
 ('62', 'field', '27', 'en', ' more about us '),
 ('62', 'field', '28', 'en', ' since 1984 victoria fans ltd have produced approximately 40 000 fans of all types for projects in both the uk and abroad we are well respected in the trade and regularly product fans for other fan suppliers '),
 ('62', 'field', '29', 'en', ' since 1984 victoria fans ltd have produced approximately 40 000 fans of all types for projects in both the uk and abroad we are well respected in the trade and regularly product fans for other fan suppliers in the uk victoria fans are sold directly to the trade through a network of professional fans heating ventilation distributors carefully selected to know both our products and the local area in which the enquirer trades in other parts of the world there is a victoria fans agent with considerable expertise and long association with strategic partners in europe the middle east far east victoria fans are happy to make dimensional and performance modification to their range of products and can fabricated exact copies of obsolete equipment we also welcome the opportunity to discuss new or different fan applications with original equipment manufacturers consultants or h v engineers '),
 ('62', 'field', '30', 'en', ' standards and certification '),
 ('62', 'field', '31', 'en', ' we produce fans of high quality and can provide certificates of conformity and test certificates when requested fan performance to bs848 and amca 210 and atex for explosion proof fans ce certificates are supplied as appropriate and o m instructions are available for all the type of fans we supply we are members of the federation of environmental trade associations ltd feta and the fan manufacturers association fma '),
