\"6\",\"10\",\"224\",\"3\",\"75\",\"2\",\"86\",\"16\",\"16\"],[\"12\",\"201\",\"152\",\"38\",\"48\",\"214\",\"197\",\"222\",\"295\",\"317\",\"159\",\"133\",\"190\",\"210\",\"286\",\"6\",\"10\",\"248\",\"3\",\"84\",\"2\",\"97\",\"17\",\"17\"],[\"15\",\"267\",\"190\",\"45\",\"50\",\"257\",\"248\",\"278\",\"360\",\"387\",\"203\",\"178\",\"240\",\"260\",\"336\",\"8\",\"10\",\"298\",\"3\",\"103\",\"2\",\"116\",\"17\",\"17\"]]}', '2017-11-24 13:40:16', '2018-09-04 12:49:35', '97e56f8a-c6c0-417c-a943-d0920c08be29');
INSERT INTO `craft_supertablecontent_fd_st_productgroupglobalspecifications` (`id`, `elementId`, `locale`, `field_fd_St_Header`, `field_fd_st_text`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '16', 'en', '', '', '2017-02-27 15:56:17', '2017-02-27 15:58:41', '7c4a1e6b-6109-47fb-96bc-d76829b02bdf'),
 ('2', '36', 'en', 'Arrangement', '<p>Direct driven Single or Multi stage fans suitable for vertical or horizontal mounting.\n  </p>', '2017-02-28 10:02:46', '2018-01-18 11:28:28', 'fb2fed84-a697-494c-84c1-71ba026bd5c6'),
 ('3', '37', 'en', 'Staging Of Axial Flow Fans', '<p>By running two Long Cased Fans in series with contra-rotating impellers, it is possible to achieve up to three times the pressure of a single stage fan of equal diameter and speed.\n  </p>', '2017-02-28 10:02:46', '2018-01-18 11:28:28', '83a109c8-0cb9-4fb5-9df4-8cc5da041861'),
 ('4', '38', 'en', 'Long Cased Type', '<p>In this instance the casing covers the entire length of the motor and impeller and an inspection door is provided.  Essentially for duct mounting where flanges are bolted back and front.\n  </p>', '2017-02-28 10:02:46', '2018-01-18 11:28:28', '01a5cd9b-f00d-479e-b16a-97d298e8f62f'),
 ('7', '41', 'en', 'Short Cased Type', '<p>The casing covers the impeller track and a portion of the motor projects beyond the end of the flange. Best installed at the end of a duct or on Air Conditioning equipment.\n  </p>', '2017-02-28 10:05:05', '2018-01-18 11:28:28', '8409fe76-342c-474d-ad4f-fb68e38ac287'),
 ('8', '42', 'en', 'Motors', '<p>In most instances foot mounted TEFC IEC 600034-1.  Electric motors are fitted with metric dimensions.   The motors are selected to cover the ‘peak’ power absorbed for fan blade pitch angle and speed.  Most standard motors have Class ‘F’ insulation and are suitable for operating at temperatures of up to 50°C (122°F). Higher temperatures available if required.\n  </p>\n<p>The standard voltages are 220, 230/380, 380, 240/215 and 460.  Motors can be wound for any voltage and frequency and also for dual voltage.  The use of standard foot mounted motors of this type guarantees inter-changeability in most countries of the world with machines of similar speed/kw. INVERTER CONTROLLED, FLAMEPROOF, SINGLE PHASE, 2 SPEED AND COMPANY SPECIFICATION MOTORS CAN ALWAYS BE OBTAINED.\n  </p>', '2017-02-28 10:05:05', '2018-01-18 11:28:28', '5e2a543c-a863-4736-92a4-47f543080faf'),
 ('9', '43', 'en', 'Standard Impellers 250-1250mm Dia', '<p>Impellers have aerofoil section polypropylene blades fitted into a die-cast aluminium hub.  Five different blade angles are available and each blade is individually replaceable in the event of breakage.  Aluminium blades are also available in selected angles.\n  </p>', '2017-02-28 10:05:05', '2018-01-18 11:28:28', '2d06bb2e-0d08-47ba-a4b0-4a72ff1f7048'),
 ('10', '44', 'en', 'Special Impellers 250-2000mm Dia', '<p>Impellers have aerofoil variable pitch aluminium blades fixed into a die-cast aluminium hub.\n  </p>', '2017-02-28 10:05:05', '2018-01-18 11:28:28', '5cd2b294-1b8e-4f81-8dd4-3b02a01dc2bb'),
 ('11', '63', 'en', 'Fractional Solidity Impellers', '<p>All sizes of impellers can supplied with varying number of blades to suit the application.  This has the effect of reducing the static capability of the fan whilst retaining a high efficiency.</p>', '2017-03-23 15:46:37', '2018-01-18 11:28:28', '1e88e680-0ecf-4d9b-b087-cb7813eb73e0'),
 ('12', '64', 'en', 'Example of Coding', '<p>A typical example of coding is 630/9/35 indicating :\n  </p>\n<ul><li>630 diameter in mm</li><li>9 number of blades</li><li>35 blade angle in degrees</li></ul>', '2017-03-23 15:50:37', '2018-01-18 11:28:28', '0e531de0-b0c3-4a61-9c9b-6b1ce1434a68'),
 ('13', '65', 'en', 'Extra Features Available', '<p>Mounting feet, flexible connections, AV Mountings, Mating Flanges, Inlet Cones, Guards, Back-draught shutters, Special Paint.  Finishes: External Terminal Box.</p>', '2017-03-23 15:50:37', '2018-01-18 11:28:28', '15276184-c433-48ba-ae11-f50da8c004fb'),
 ('14', '66', 'en', 'Finish', '<ul><li>Standard Fans: Galvanised</li><li>Optional Finishes: Epoxy Resin, Metal Spraying</li></ul>', '2017-03-23 15:50:37', '2018-01-18 11:28:28', '2d14a8dc-cb64-42c3-8c8f-c6b7e6a99e02'),
 ('15', '67', 'en', 'Uses', '<p>For exhausting hot gasses, paint fumes (excluding, cellulose), steam, smoke and dust laden air, available in diameters 250-1250mm.</p>', '2017-03-23 16:22:43', '2017-11-24 09:33:00', '06f95625-bc43-4406-ac6b-591a93f7beba'),
 ('16', '68', 'en', 'Fan Type NT', '<p>Normal Temperature – upto 80°C (176°F).   Constructed in mild steel with a polypropylene impeller and Class F insulation motor.   Special corrosion- resistant finishes available. Standard finish - Galvanised.</p>', '2017-03-23 16:22:43', '2017-11-24 09:33:00', '823b53ea-c0db-42b2-9c0f-671ac3dd01f2'),
 ('17', '69', 'en', 'Fan Type HT', '<p>High Temperature  - upto 200°C (392°F).  Constructed in mild steel with an aluminium impeller and Class F insulation motor.  Special corrosion- resistant finishes available. Standard finish  - galvanised.</p>', '2017-03-23 16:22:43', '2017-11-24 09:33:00', '5c376ea3-a6f3-4383-9734-eed2b42d5c50'),
 ('18', '70', 'en', 'Motors', '<p>Standard three or single phase motors can be fitted along with ATEX ZONE 1 or 2 and company specification units when required.</p>', '2017-03-23 16:22:43', '2017-11-24 09:33:00', 'b8d224af-cd3c-4e88-b0a2-4665aeecf7fb'),
 ('19', '71', 'en', 'Plastic Fans', '<p>This range of fans can also be constructed from rigid PVC sheet reinforced with fibreglass and suitable for a wide fans of uses in the chemical industry and in the extraction of acid fumes from industrial processes.  Dimensions and performance data as for normal Bifurcated fans.\n  </p>\n<p>For exhausting hot gasses, chemical vapours, steam and moisture laden air, available in diameters 250-1000mm.  Max temp 60°C</p>', '2017-03-23 16:22:43', '2017-11-24 09:33:00', '8fae0c6b-9f7c-4e82-b875-69d9dfa271f6'),
 ('20', '72', 'en', 'Stainless Steel Fan Type 304', '<p>Ideal for use in the catering industry for air temperature upto 80°C (176°F).  For exhausting warm air and steam.  Constructed throughout in stainless steel with a polypropylene impeller and Class ‘F’ standard motor with a stainless steel extended shaft.</p>', '2017-03-23 16:22:43', '2017-11-24 09:33:00', '93379613-80a5-4fdc-a745-3b69e52d6bc7'),
 ('21', '73', 'en', 'Stainless Steel Fan Type 316', '<p>Uses mainly in the chemical and allied trades.  Suitable for most acid vapours upto 80°C (176°F).  Constructed throughout in stainless steel with a polypropylene impeller and Class F standard motor with a stainless steel extended shaft.</p>', '2017-03-23 16:22:43', '2017-11-24 09:33:00', 'c2cf7b46-287a-43c1-a570-86949f9b781e'),
 ('22', '74', 'en', 'Extra Features Available', '<ul><li>Mounting feet</li><li>flexible connections</li><li>AV Mountings</li><li>Mating Flanges</li><li>Inlet Cones</li><li>Guards</li><li>Back-draught shutters</li><li>Special Paint finishes</li></ul>', '2017-03-23 16:22:43', '2017-11-24 09:33:00', 'f073afbf-c367-4d3f-b807-319b6c9f1319'),
 ('23', '75', 'en', 'Finish', '<ul><li><strong>Standard Fans:</strong> Galvanised</li><li><strong>Optional Finishes:</strong> Epoxy Resin, Metal Spraying</li></ul>', '2017-03-23 16:22:43', '2017-11-24 09:33:00', '94239eed-56eb-4e3e-a5e0-4c68f9278045'),
 ('24', '76', 'en', 'Applications', '<p>Engineers must consider the use of Centrifugal Fans instead of Axial fans for some of the following reasons:</p>\n<ol><li><ol><li>High Temperature</li><li>Low Noise Levels</li><li>Dust &amp; Fume Extract</li><li>High Static Watergauge</li></ol></li></ol>', '2017-03-23 16:28:11', '2018-06-20 09:49:53', '16be3d1f-c697-4f5d-bdf7-9c0bf61755b7'),
 ('25', '77', 'en', 'Types of Centrifugal Fans', '<p>There are different types of Centrifugal Fans covering air volumes from 85 to 100,000m³/hr and from 25 to 15,000 PA.  Each application requires a fan with different characteristics, whether it be the blade design, the width of the casing or even the method of drive.  By way of a guide as to which is the best fan for certain projects, we list below information that might assist the potential user.</p>', '2017-03-23 16:28:11', '2018-06-20 09:49:53', '9b7d4300-df8b-4eb1-abd1-39f720ce4c1f'),
 ('26', '78', 'en', 'Impellers', '<p>Dynamically balanced aluminium aerofoil section or steel or stainless steel for higher temperatures.</p>', '2017-03-24 16:24:44', '2017-10-03 08:47:02', 'ca1ed596-2dd0-46bd-acd4-ca0491de7d51'),
 ('27', '79', 'en', 'Fan Casing', '<p>Victoria standard short or long casing to suit application, heavy gauge fabricated steel welded construction galvanised or epoxy coated after manufacture.  Diameters from 250-1600mm</p>', '2017-03-24 16:24:44', '2017-10-03 08:47:02', 'a20f9a37-516e-49c9-96b3-01142b9065e3'),
 ('28', '80', 'en', 'Terminal Box Connection', '<p>One of the most important aspects of smoke extract units is the provision of a suitable cable material that will not perish with heat and that will continue to power the motors at elevated temperatures.</p>', '2017-03-24 16:24:44', '2017-10-03 08:47:03', 'cfe74ecf-236b-4434-9865-1304ddd3739c'),
 ('29', '81', 'en', 'Emergency Smoke Roof Extract Fans', '<p>Incorporating axials fans as described above and Vertical Jet Roof Cowls.  Fabricated in steel and finished in powder epoxy polyester resin with galvanised steel backdraught shutters. Provides an ideal terminal device for a smoke extract duct.</p>', '2017-03-24 16:24:44', '2017-10-03 08:47:03', '3378d3e4-7c6f-4d21-b6b8-6029fae6348a'),
 ('30', '82', 'en', '', '<ul><li><strong>300°C/2hrs                            BSEN 12101-3</strong></li><li><strong>400°C/2hrs                            BS 7346</strong></li></ul>', '2017-03-24 16:24:44', '2017-10-03 08:47:03', '01a71214-abfd-42b8-91e5-7db16c6d2869'),
 ('31', '83', 'en', 'Standard Construction', '<p>Moulded Fibreglass Cowels or Fabricated Mild Steel Cowls with epoxy polyester resin coating after manufacture, standard colour beige RAL 1013.</p>\n<p>The Vertical Jet unit is fitted with backdraught shutters as standard.</p>\n<p>The Low Profile unit can be fitted with backdraught shutters if required.</p>\n<p>The standard units are fitted with epoxy polyester coated Plate Mounted or Short Cased Axial Fans. They can be fitted with Long Casings if required for duct mounting.</p>', '2017-03-27 14:19:34', '2018-09-04 12:49:15', '31900682-df86-4aec-bed3-58091e876409'),
 ('32', '84', 'en', 'Special Construction', '<p>All Victoria Fan Roof Units can be fabricated in Stainless Steel or Aluminium if required.</p>', '2017-03-27 14:23:23', '2018-09-04 12:49:15', '59f77736-e7cc-4f65-9060-c549e4224712'),
 ('33', '85', 'en', 'Silencers', '<p>Silencers may also be fitted to any of the fans used in Victoria Roof Units.</p>', '2017-03-27 14:23:23', '2018-09-04 12:49:15', 'e881e5b6-325a-41a7-91a7-74948e09161c'),
 ('34', '86', 'en', 'Roof Units for Input (Low Profile Design only)', '<p>By removing the backdraught shutters Victoria Low Profile Units can be used to Input to give general ventilation.</p>', '2017-03-27 14:23:23', '2018-09-04 12:49:15', '7a2896e5-486d-4c3c-b600-5da01e610d4e'),
 ('35', '87', 'en', 'Special Sizes', '<p>Victoria Roof Units can be fabricated to suit non standard roof openings if required.</p>', '2017-03-27 14:23:23', '2018-09-04 12:49:15', 'a29126fa-7d69-4606-87e1-b59674dddeba'),
 ('36', '88', 'en', 'Paddle Blade Fans', '<p>This type of fan is used for the conveying of dust, wood and paper refuse, cotton fly etc.  Since the blade design prevents ‘build up’ of waste materials, discharge velocities vary dependent upon what is being conveyed in the air stream.  Normally in the region of 7-20 mtrs/sec.</p>', '2017-03-27 14:32:13', '2018-06-20 09:49:53', '67196566-bc6d-4866-b42c-464647cd31d6'),
 ('37', '89', 'en', 'Multivane or Forward Curved Fans', '<p>Used for general ventilation purposes – not good for dust etc.  Limited pressure characteristics.  Normal discharge velocities 5-13 mts/sec</p>', '2017-03-27 14:32:13', '2018-06-20 09:49:53', '18837f28-b4d2-4ce8-b15b-e783e5273902'),
 ('38', '90', 'en', 'Backward Curved or Backward Sloping Fans', '<p>Non overloading power characteristics suitable for very light dust applications (eg clean side of dust collector) where a good efficiency is required.  Used for high pressure ventilation systems or where the system resistance could fluctuate.  Normal velocities 9-16 mts/sec</p>', '2017-03-27 14:32:13', '2018-06-20 09:49:53', 'bb114a6c-7485-40fb-b2e1-3092b4971753'),
 ('39', '91', 'en', 'Aerofoil Fans', '<p>The most efficient of all centrifugals fans, ideally suited to general ventilation projects where there is no possibility of dust contamination.  Recommend for high pressure ventilation systems or where the system resistance could fluctuate.  Normal discharge velocities 7-15 mts/sec.</p>', '2017-03-27 14:32:13', '2018-06-20 09:49:53', 'ab38e2b7-f35c-4d3d-9f5f-5be5a48135b9'),
 ('40', '92', 'en', 'High Pressure Blowers', '<p>As their name suggests, these fans are applied where the requirement is for high velocities, eg Air Curtains, refuse conveying etc  Normal discharge velocities 15-30 mts/sec.</p>', '2017-03-27 14:32:13', '2018-06-20 09:49:53', '471681b6-1b30-41b1-aa29-08a18facfc3c'),
 ('45', '132', 'en', 'Finish', '<p>Standard Silencers – galvanised sheet.</p>', '2017-07-25 15:02:25', '2017-07-25 15:09:21', '6d1105dd-428a-4025-926a-92bc582f610b'),
 ('46', '133', 'en', 'Optional Extras', '<p>Melinex lining for steam/high humidity/hospital and food industries.  Epoxy coating, Stainless steel construction.</p>', '2017-07-25 15:02:25', '2017-07-25 15:09:21', 'd6bac41b-9ee5-47d0-8a1c-f7dec4f1401f'),
 ('47', '139', 'en', 'Construction', '<p>The standard construction comprises mild steel fan body and swivel base with polypropylene or aluminium impeller &amp; galvanised finish. An external terminal box is fitted to the outside of the casing for ease of connection onsite. The fans are supplied with inlet and outlet guards.</p>', '2017-07-26 10:23:02', '2018-09-03 11:06:50', '99040f19-b5cb-4a5f-9a9c-27c68a514284'),
 ('48', '140', 'en', 'Motors', '<p>Up to size 50cm, the fans can be fitted with single or three phase electric motors, thereafter they are normally fitted with three phase motors only.</p>\n<p>For the Petro-Chemical and other hazardous industries, the fans can be fitted with EExd Zone 1 or Zone 2 Motors.</p>', '2017-07-26 10:26:09', '2018-09-03 11:06:50', 'bcc3922e-1529-4d88-baef-82f7dbb39c19'),
 ('49', '141', 'en', 'Extras - If required', '<p>2 Speed Motors, Pre-wired starters, Epoxy Coating, Fixed or free casters and special voltages.</p>', '2017-07-26 10:26:09', '2018-09-03 11:06:50', '17449e19-73ca-4a5b-abb8-14790f52158e');
